(7,1,1,'Informacje Prawne','','','','\n<h1 class=\"other-title\">Polityka prywatności</h1>\n<div> </div>\n<div>\n<div style=\"text-align:center;\">\n<div style=\"text-align:left;\"><strong>Postanowienia ogólne</strong></div>\n<div style=\"text-align:left;\"><br />\n<div>Przetwarzanie danych osobowych</div>\n<div>Chronimy i przetwarzamy Twoje dane osobowe:</div>\n<div>a) zgodnie z Rozporządzeniem Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (ogólne rozporządzenie o ochronie danych) zwanym dalej RODO,</div>\n<div>b) na zasadach opisanych w niniejszym dokumencie zwanym dalej „Polityką Prywatności”, który obowiązuje od dnia 24.05.2018r.</div>\n<div> </div>\n</div>\n</div>\n<div><br />1. Niniejszy dokument określa zasady przetwarzania i ochrony danych osobowych Klientów Sklepu Internetowego działającego pod adresem www.twojapasmanteria.pl (Polityka Prywatności).</div>\n<div><br />2. Wyrazy pisane wielką literą, a niezdefiniowane inaczej w niniejszym dokumencie mają znaczenie takie jak nadane im w Regulaminie sprzedaży przy wykorzystaniu środków porozumiewania się na odległość oraz świadczenia usług drogą elektroniczną dostępnym pod adresem: http://twojapasmanteria.pl/tp17/content/2-polityka-prywatnosci</div>\n<div><br />3. Jesteśmy odpowiedzialni za to w jakim celu i jak wykorzystujemy Twoje dane osobowe. Podmiotem odpowiedzialnym (zwanym dalej „Administratorem”) za przetwarzanie danych osobowych jest: MakArt S.C. Anna Makowska Agnieszka Makowska NIP: 6431769263 REGON: 369036029</div>\n<div><br />4. Usługodawca przestrzega zasad ochrony prywatności Klientów Sklepu Internetowego, przewidzianych Ustawą o ochronie danych osobowych.</div>\n<div>Zakres i cel zbieranych danych</div>\n<div><br />5. Polityka Prywatności ma zastosowanie do danych osobowych zbieranych w serwisie Usługodawcy oraz Sklepie Internetowym:</div>\n<div>a. w celu realizacji Zamówienia/Rezerwacji i sprawnego prowadzenia i funkcjonowania Sklepu Internetowego, w tym zbieranych automatycznie w toku realizacji Zamówienia/Rezerwacji i/lub wizyty w Sklepie Internetowym;</div>\n<div>b. w celu rejestracji Konta Klienta w Sklepie Internetowym;</div>\n<div><br />6. W celu realizacji Zamówienia/Rezerwacji Usługodawca zbiera następujące dane Klienta: imię i nazwisko, telefon kontaktowy, adresy: e-mail, zameldowania, dostawy, do wystawienia dokumentu księgowego, nazwa przedsiębiorcy oraz numer NIP, w przypadku przedsiębiorców.</div>\n<div><br />7. W celu rejestracji Konta Klienta w Sklepie Internetowym zbierane są następujące dane Klienta: imię i nazwisko, adres e-mail, Hasło.</div>\n<div><br />8. Usługodawca oświadcza, że podanie danych wskazanych w punkcie 6 i 7 powyżej, oznaczonych w Sklepie Internetowym jako wymagane, jest dobrowolne, jednak konieczne w celu realizacji Zamówienia/Rezerwacji lub rejestracji Konta Klienta.</div>\n<div><br />9. Dane osobowe Klientów zbierane w celu realizacji Zamówienia/Rezerwacji i sprawnego prowadzenia i funkcjonowania Sklepu Internetowego oraz rejestracji Konta Klienta przetwarzane są przez Usługodawcę w celu:</div>\n<div>a. sprzedaży Klientom Towarów oraz świadczenia Klientom usług, oraz ich dostawy Klientom,</div>\n<div>b. obsługi procesu Rejestracji, logowania do Konta Klienta,</div>\n<div>c. ewentualnego dochodzenia roszczeń,</div>\n<div>d. wyjaśnienia okoliczności niedozwolonego korzystania z usług świadczonych drogą elektroniczną,</div>\n<div>e. tworzenia raportów i analiz na potrzeby Usługodawcy dotyczących funkcjonowania Sklepu Internetowego, w tym statystyk oglądalności podstron serwisu Sklepu Internetowego,</div>\n<div>f. dostosowania Sklepu Internetowego do potrzeb Klientów,</div>\n<div><br />10. Niezależnie od powyższego, w przypadku wyrażenia odrębnej zgody przez Klienta, dane osobowe Klienta przetwarzane są przez Usługodawcę w celu:</div>\n<div>a. marketingu działalności Usługodawcy oraz marketingu działalności podmiotów współpracujących z Usługodawcą, w szczególności w celu organizacji promocji, konkursów i realizacji innych narzędzi marketingowych,</div>\n<div>b. otrzymywania informacji handlowej, w szczególności przesyłania przez Usługodawcę na wskazany przez Klienta adres poczty elektronicznej, zamówionego elektronicznego biuletynu (newsletter).</div>\n<div><br />11. Usługodawca informuje, że podczas korzystania ze Sklepu Internetowego dane dotyczące Klienta zbierane są również automatycznie. Dane te mogą być zbierane w logach systemowych Sklepu Internetowego, przez pliki Cookies</div>\n<div><br />12. Usługodawca informuje, że z momentem połączenia się przez Klienta ze Sklepem Internetowym w logach systemowych Sklepu Internetowego pojawia się informacja o numerze (w tym IP) i rodzaju urządzenia końcowego Klienta, z którego Klient łączy się ze Sklepem Internetowym. Usługodawca informuje, że zgodnie z prawem przetwarza również dane dotyczące numeru (w tym IP) i rodzaju urządzenia końcowego Klienta, a także czasu połączenia Klienta ze Sklepem Internetowym oraz inne dane eksploatacyjne dotyczące aktywności Klienta w Sklepie Internetowym. Opisane dane przetwarzane są w celach technicznych oraz do zbierania ogólnych informacji statystycznych dotyczących funkcjonowania Sklepu Internetowego.</div>\n<div><br />13. Usługodawca wykorzystuje pliki typu Cookies w celu gromadzenia informacji związanych z korzystaniem ze Sklepu Internetowego przez Klienta.</div>\n<div>Pliki typu Cookies to dane informatyczne, w szczególności niewielkie pliki tekstowe, zapisywane i przechowywane na urządzeniach za pośrednictwem których Klient, korzysta ze stron internetowych Sklepu Internetowego, które umożliwiają:</div>\n<div>a. utrzymanie sesji Klienta (po zalogowaniu), dzięki której Klient nie musi na każdej podstronie Sklepu Internetowego ponownie wpisywać Loginu i Hasła,</div>\n<div>b. dostosowanie i optymalizację Sklepu Internetowego do potrzeb Klientów oraz innych osób korzystających ze Sklepu Internetowego,</div>\n<div>c. tworzenie statystyk oglądalności podstron Sklepu Internetowego,</div>\n<div>d. personalizację przekazów marketingowych,</div>\n<div>e. zapewnienie bezpieczeństwa i niezawodności działania Sklepu Internetowego.</div>\n<div> </div>\n<div>W serwisie wykorzystywane są Cookies sesyjne, ulegające skasowaniu po zamknięciu okna przeglądarki internetowej, jak i Cookies trwałe, zapisywane na określony czas w urządzeniach, za pośrednictwem których Klient korzysta ze Sklepu Internetowego.</div>\n<div> </div>\n<div>Klient, może samodzielnie i w każdym czasie zmienić ustawienia dotyczące plików Cookies, określając warunki ich przechowywania i uzyskiwania dostępu przez pliki Cookies do Urządzenia Klienta. Zmiany ustawień, o których mowa w zdaniu poprzednim, Klient może dokonać za pomocą ustawień przeglądarki internetowej lub za pomocą konfiguracji usługi. Ustawienia te mogą zostać zmienione w szczególności w taki sposób, aby blokować automatyczną obsługę plików Cookies w ustawieniach przeglądarki internetowej bądź informować o każdorazowym zamieszczeniu Cookies na urządzeniu Klienta. Szczegółowe informacje o możliwości i sposobach obsługi plików Cookies dostępne są w ustawieniach oprogramowania (przeglądarki internetowej) Klienta.</div>\n<div> </div>\n<div>Klient może w każdej chwili usunąć pliki Cookies korzystając z dostępnych funkcji w przeglądarce internetowej, której używa.</div>\n<div> </div>\n<div>Ograniczenie stosowania plików Cookies, może wpłynąć na niektóre funkcjonalności dostępne na stronie internetowej Sklepu Internetowego.</div>\n<div> </div>\n<div>W Sklepie Internetowym wykorzystywane są również Cookies zamieszczane przez partnerów Usługodawcy, umożliwiające personalizację działalności reklamowej i rozliczanie jej efektów. Polityka Prywatności nie reguluje sposobu wykorzystywania plików Cookies przez podmioty trzecie. Więcej informacji o tych plikach Cookies może być dostępnych na poszczególnych stronach partnerów Usługodawcy.</div>\n<div><br />14. Niektóre podstrony serwisu Sklepu Internetowego oraz inne środki komunikacji z Klientami mogą zawierać tzw. „web beacons” (tzw. elektroniczne obrazki, zwane również jako puste gify). Web Beacons pozwalają na otrzymanie informacji takich jak np. adres IP (Internet Protocol) komputera, na który załadowana została strona, na której Web Beacon został zamieszczony, numer URL strony, czas załadowania strony, rodzaj przeglądarki, jak również informacje zawarte w Cookies, w celu oceny efektywności reklam.</div>\n<div>Prawa i obowiązki Usługodawcy</div>\n<div><br />15. Usługodawca zastrzega sobie prawo ujawnienia wybranych informacji dotyczących Klienta właściwym organom władzy bądź osobom trzecim, które zgłoszą żądanie udzielenia takich informacji, w oparciu o odpowiednią podstawę prawną, zgodnie z przepisami obowiązującego prawa.</div>\n<div><br />16. Usługodawca oświadcza, że powierza przetwarzania danych osobowych Klienta lub innych danych, o których mowa w Polityce Prywatności, na podstawie pisemnej umowy zawartej zgodnie z art. 31 Ustawy o ochronie danych osobowych, podmiotom świadczącym na rzecz Usługodawcy usługi hostingu, administracji, utrzymywania oraz zarządzania Sklepem Internetowym.</div>\n<div><br />17. Usługodawca oświadcza, że powierza przetwarzania danych osobowych Klienta lub innych danych, o których mowa w Polityce Prywatności innym podmiotom świadczącym na rzecz Usługodawcy lub bezpośrednio Klienta usługi w zakresie niezbędnym do realizacji Zamówienia/Rezerwacji, rozpatrzenia reklamacji oraz skorzystania z usług finansowych dostępnych w Sklepie Internetowym, na podstawie pisemnej umowy zawartej zgodnie z art. 31 Ustawy o ochronie danych osobowych. Dane osobowe Klientów mogą zostać powierzone w szczególności kurierom, ubezpieczycielom, Pośrednikom kredytowym/finansowym, Pożyczkodawcom, instytucjom finansowym.<br /><br /></div>\n<br />\n<div>Prawa i obowiązki Klienta<br /><br />\n<div>Zgodnie z RODO masz prawo do ochrony swoich danych osobowych, w szczególności masz prawo do:</div>\n<div>a) żądania od Administratora dostępu do swoich danych osobowych;</div>\n<div>b) sprostowania swoich danych osobowych;</div>\n<div>c) usunięcia swoich danych osobowych;</div>\n<div>d) ograniczenia przetwarzania swoich danych osobowych;</div>\n<div>e) wniesienia sprzeciwu wobec przetwarzania swoich danych osobowych;</div>\n<div>f) przenoszenia swoich danych osobowych;</div>\n<div>g) wycofania zgody na przetwarzanie swoich danych osobowych w dowolnym momencie;</div>\n<div>h) wniesienia skargi do organu nadzorczego - Generalnego Inspektora Danych Osobowych;</div>\n<div>Jeżeli chcesz wycofać zgodę na otrzymywanie newslettera – w każdym newsletterze od nas znajdziesz link do anulowania subskrypcji. Kliknij link i potwierdź anulowanie subskrypcji.</div>\n<div>W pozostałych przypadkach ze swoich praw możesz skorzystać kontaktując się z nami mailowo sklep@twojapasmanteria.pl</div>\n</div>\n<div><br />18. Każdy Klient ma prawo dostępu do treści swoich danych osobowych, prawo ich poprawiania, uzupełniania oraz prawo żądania zaprzestania przetwarzania danych i ich usunięcia. W tym celu należy wysłać maila na adres sklep@twojapasmanteria.pl, zadzwonić pod numer telefonu 785 82 16 11 lub skorzystać z funkcji „Twoje konto” dostępne Sklepie Internetowym.</div>\n<div><br />19. W przypadku, gdy Usługodawca występuje o wyrażenie zgody na przesyłanie informacji handlowej drogą elektroniczną (np. za pośrednictwem poczty e-mail, SMS i inne) osobie, która wyraziła powyższą zgodę przysługuje prawo jej cofnięcia. W tym celu należy: wysłać e-mail na adres: sklep@twojapasmanteria.pl wpisując w tytule słowo „rezygnacja”, zadzwonić pod numer telefonu 785 82 16 11 i poinformować o cofnięciu zgody, kliknąć na link powodujący cofnięcie zgody umieszczony w treści informacji handlowej, lub wysłać pisemną informacje na adres Usługodawcy o cofnięciu zgody na otrzymywanie informacji handlowej.</div>\n<div><br />20. Jeżeli Klient umieszcza w Sklepie Internetowym jakiekolwiek dane osobowe innych osób (w tym ich imię i nazwisko, adres, numer telefonu lub adres e-mail), może to uczynić jedynie pod warunkiem nienaruszania przepisów obowiązującego prawa i dóbr osobistych tych osób.</div>\n<div><br />21. Klient uprawniony jest do korzystania z danych i treści udostępnionych przez innych Klientów Sklepu Internetowego wyłącznie w związku z korzystaniem ze Sklepu Internetowego oraz za ich zgodą w sposób zgodny z przepisami obowiązującego prawa, chyba że uzyska zgodę od tych Klientów na przetwarzanie ich danych i ich treści w zakresie lub celu wykraczającym poza korzystanie ze Sklepu Internetowego.</div>\n<div>Zabezpieczenie danych</div>\n<div><br />22. Usługodawca oświadcza, iż dokłada starań, aby zapewnić Klientom wysoki poziom bezpieczeństwa w zakresie korzystania ze Sklepu Internetowego. Wszelkie zdarzenia mające wpływ na bezpieczeństwo przekazu informacji, danych, w tym również dotyczące podejrzenia udostępniania plików zawierających wirusy i innych plików o podobnym charakterze lub innych, aniżeli pliki mechanizmów destrukcyjnych należy zgłaszać Usługodawcy na konto e-mail: sklep@twojapasmanteria.pl</div>\n</div>\n<p><br /><strong>Zmiany Polityki Prywatności</strong></p>\n<div>Zastrzegamy sobie prawo do zmiany Polityki Prywatności bez podawania przyczyny w dowolnym momencie. Zmiany, o których mowa nie ograniczają praw nabytych przez wejściem zmian w życie. O treści zmian poinformujemy na naszej stronie internetowej www.twojapasmanteria.pl </div>\n<p>Licencja:</p>\n<p>Ten sklep został wykonany przy użyciu <a href=\"http://www.prestashop.com\">PrestaShop</a>™ - oprogramowanie na licencji <a href=\"http://www.opensource.org/licenses/osl-3.0.php\">Open Software License (OSL) v. 3.0.</a></p>\n\n<p></p>','informacje-prawne'),
(8,1,1,'Regulamin Sklepu','','','','<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Regulamin sklepu internetowego twojapasmanteria.pl</span></strong></p>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">I. Postanowienia ogólne</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Przedsiębiorcą prowadzącym sklep internetowy, znajdujący się pod domeną internetową http://</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl /, zwany dalej „ Sklepem Internetowym ” jest  </span></span><span style=\"font-family:\'times new roman\', times;font-size:12pt;\">MakArt S.C. Anna Makowska, Agnieszka Makowska ul. Fitznerów 2 41-100 Siemianowice Śl NIP 6431769263, REGON 369036029, wpisany do rejestru przedsiębiorców CEIDG.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Kontakt ze Sklepem Internetowym jest możliwy za pośrednictwem poczty elektronicznej: sklep@</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl.pl lub pod nr. tel.:601 09 85 46 <br /><br /></span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Regulamin określa prawa i obowiązki Klientów jak również prawa i obowiązki Sprzedawcy jako podmiotu zarządzającego i prowadzącego Sklep.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Regulamin jest dostępny w polskiej wersji językowej.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klienci zobowiązani są do przestrzegania autorskich praw majątkowych oraz praw wynikających z rejestracji wynalazków, patentów, znaków towarowych, wzorów użytkowych i przemysłowych.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Właściciel www.</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl zobowiązuje się do bezpiecznego przetwarzania danych osobowych klientów sklepu wyłącznie w celu rzetelnego wykonania umowy sprzedaży zawartej na odległość. Polityka Prywatności udostępniana jest w trakcie składania zamówienia oraz przesyłana każdorazowo w wiadomości e-mail wraz z potwierdzeniem złożonego zamówienia.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\"> </span></p>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">II. Definicje</span></strong></p>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Użyte w Regulaminie pojęcia oznaczają odpowiednio:</span></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep – sklep internetowy działający pod adresem www.</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl.pl, prowadzący sprzedaż produktów znajdujących się w jego ofercie.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Właściciel – </span></span><span style=\"font-family:\'times new roman\', times;font-size:12pt;\">MakArt S.C. Anna Makowska, Agnieszka Makowska ul. </span><span style=\"font-family:\'times new roman\', times;font-size:12pt;\"><span style=\"font-family:\'times new roman\', times;font-size:12pt;\">Fitznerów 2 41-100</span> Siemianowice Śl NIP 6431769263, REGON 369036029, wpisany do rejestru przedsiębiorców CEIDG</span>.</li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient – każdy podmiot dokonujący zakupu w Sklepie zgodnie z treścią niniejszego Regulaminu.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Konto Klienta – pole zawierające dane na temat przeprowadzanych transakcji oraz instrument służący do realizacji składanych przez Klienta zamówień.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Newsletter– usługa świadczona przez Sklep na rzecz Użytkownika polegająca na wysyłaniu mu wszelkich informacji o działaniu Sklepu, po dobrowolnym podaniu przez Użytkownika adresu e-mail, imienia i nazwiska.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Konsument - osoba fizyczna dokonująca czynności prawnej z przedsiębiorcą niezwiązanej bezpośrednio z jej działalnością gospodarczą lub zawodową.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Przedsiębiorca – osoba fizyczna, osoba prawna lub jednostka nieposiadająca osobowości prawnej, dokonująca czynności prawnej we własnym imieniu w ramach działalności gospodarczej lub zawodowej.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Dni robocze – dni tygodnia od poniedziałku do piątku, poza dniami ustawowo wolnymi od pracy.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Regulamin – niniejszy dokument, określa warunki i zasady korzystania ze Sklepu oraz nabywania w nim produktów.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">III. Techniczne warunki korzystania ze Sklepu</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">W celu korzystania ze Sklepu, Klient powinien posiadać:<br />- urządzenie przekazujące dane teleinformatyczne;<br />- dostęp do sieci Internet; <br />- adres poczty email.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep zbiera informacje zawarte w plikach cookies, które są plikami tekstowymi. Pliki te nie zachowują żadnych danych personalnych, używane są w sposób anonimowy w celu ocenienia realnego zainteresowania serwisem na stronach sklepu. Pliki Cookies, służą do wymiany informacji pomiędzy Sklepem a Użytkownikiem, co w znacznym stopniu ułatwia dopasowanie oferty do oczekiwań i preferencji każdego Użytkownika Sklepu. Klient decyduje o stosowaniu plików cookies. Przeglądarki internetowe często domyślnie mają ustawioną możliwość instalowania tych plików na urządzeniu końcowym Klienta, który w każdym czasie może dokonać zmiany ustawień.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep informuje, iż wyłączenie przez Klienta możliwości korzystania z plików Cookies może wpłynąć na funkcjonalności dostępne w Sklepie. 4. Szczegółowe informacje dotyczące plików Cookies zawarte są w Polityce Plików Cookies, udostępnionej pod adresem www.</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl.pl i stanowiącej integralną część niniejszego regulaminu.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">IV. Rejestracja i Logowanie</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient w celu założenia „Konta Klienta” dokonuje rejestracji, podając login, adres e-mail oraz hasło, za pomocą formularza.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Hasło podawane przy logowaniu do Sklepu może składać się z liter, cyfr lub/oraz znaków specjalnych. Hasło jest indywidualne dla każdego użytkownika. Hasło można zmienić na stronie poprzez podanie adresu e-mail oraz nowego hasła.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Założenie „Konta klienta” jest nieodpłatne.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Rejestracja nie jest warunkiem złożenia zamówienia w Sklepie.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient zobowiązuje się do podania prawdziwych danych.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient przez akceptację regulaminu składa oświadczenie następującej treści:<br />- przystąpiłem dobrowolnie do korzystania z usług sklepu;<br />- dane zawarte w formularzu są zgodne z prawdą.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient nie może przekazywać hasła dostępu do konta w Sklepie internetowym osobom trzecim.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Zarejestrowany Klient ma możliwość: <br />- dostępu do statusu oraz historii zamówień;<br />- otrzymywania indywidualnych rabatów i kuponów promocyjnych;<br />- informacji o możliwości udziału w promocjach i konkursach;<br />- zamówienia Produktu, zmiany swoich danych;<br />- zmiany swojego hasła;<br />- sprawdzenia swoje zamówienia;<br />- całkowitego usunięcia swojego konta.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Po dokonaniu rejestracji Klient otrzyma na podany adres e-mail link do strony internetowej, aktywujący konto.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Dokonanie aktywacji umożliwia zalogowanie do systemu.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient nie może kopiować, modyfikować ani rozpowszechniać treści, zdjęć logotypów bez uprzedniej zgody osoby uprawnionej.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">V. Realizacja zamówień</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep jest czynny przez 24 godziny na dobę, 7 dni w tygodniu, umożliwiając Klientowi złożenie zamówienia o każdej porze, poza przerwami konserwacyjnymi. Klient ma również możliwość złożyć zamówienie osobiście w siedzibie, w godzinach otwarcia. Zamówienia realizujemy do 2-3 dni od zaksięgowania wpłaty na konto lub dnia złożenia zamówienia za pobraniem,</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Umieszczenie na witrynie Sklepu Internetowego określonego towaru wraz z oznaczeniem jego ceny nie stanowi oferty jego sprzedaży, a jedynie zaproszenie dla Kupujących do składania ofert.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Zamówienie zostaje złożone przez Kupującego w formie elektronicznej i stanowi ofertę zawarcia umowy sprzedaży towaru umieszczonego na witrynie Sklepu Internetowego, za określoną tam cenę. Oferta złożona w postaci elektronicznej wiąże Kupującego, jeżeli Sklep Internetowy niezwłocznie potwierdzi jej otrzymanie.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep Internetowy potwierdza otrzymanie zamówienia przez automatycznie generowaną wiadomość e-mail, którą wysyła Kupującemu. Wiadomość zawiera proponowaną treść umowy sprzedaży, w szczególności: numer i datę zamówienia, dane zakupionego towaru, cenę i sposób jej zapłaty, dane stron umowy, miejsce, sposób i koszt dostawy.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Jeżeli proponowana treść umowy sprzedaży nie jest zgodna z zamówieniem złożonym przez Kupującego, Kupujący powinien bez zbędnej zwłoki zawiadomić o tym Sklep Internetowy wysyłając wiadomość e-mail ze wskazaniem zauważonych rozbieżności. Sklep Internetowy bez zbędnej zwłoki prześle Kupującemu skorygowaną treść proponowanej umowy.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep Internetowy potwierdza przyjęcie zamówienia do realizacji wysyłając Kupującemu kolejną wiadomość e-mail. Z chwilą otrzymania tej wiadomości przez Kupującego następuje zawarcie umowy sprzedaży.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Do sprzedawanego towaru dołączana jest karta gwarancyjna producenta, importera lub dystrybutora – jeżeli producent, importer lub dystrybutor udzielają gwarancji na podstawie pisemnej karty gwarancyjnej.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klientami w przypadku osób fizycznych mogą być tylko osoby posiadające pełną zdolność do czynności prawnych.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient składa zamówienie w następujący sposób: <br />- wybór towarów dokonywany przez dodanie ich do koszyka;<br />- podanie danych do formularza rejestracyjnego bądź logowania, formularza dostawy; <br />- wybór formy dostawy i płatności;<br />- zatwierdzenie zamówienia przez przycisk „zamówienie z obowiązkiem zapłaty”;<br />- wysłanie potwierdzenia zamówienia na adres e-mail Klienta;<br />- zamówienie złożone w formie elektronicznej będzie potwierdzone nie później niż w ciągu dwóch dni roboczych (z wyłączeniem świąt) od otrzymania zamówienia. Potwierdzenie wysłane będzie e-mailem lub telefonicznie.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Zarejestrowani Klienci mają możliwość śledzić status realizacji zamówienia.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Zamówienia można składać również z pominięciem rejestracji na stronie internetowej Sklepu poprzez: <br />- wysłanie wiadomości e-mail na adres: sklep@</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl.pl;<br />- telefonicznie ,w godzinach pracy obsługi Sklepu dzwoniąc pod nr tel.: 785 82 16 11</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient, który skorzysta ze sposobów wskazanych w pkt. 11., pomijając stronę Sklepu ma obowiązek zapoznania się i akceptacji regulaminu przesłanego przez Sklep na podany przez Klienta adres email.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient korzystając z jednego ze sposobów złożenia zamówienia wskazanych w pkt. 11., powinien podać: <br />- nazwę, rozmiar i ilość produktów;<br />- imię i nazwisko odbiorcy;<br />- dokładny adres dostawy;<br />- numer telefonu kontaktowego;<br />- adres e-mail zamawiającego.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient zobowiązuje się do podania prawdziwych danych.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Potwierdzenie zamówienia przesyłane do Klienta zawiera: <br />- dane Sklepu w tym dokładny adres korespondencyjny, adres e-mail oraz nr telefonu;<br />- opis produktu;<br />- jednostkową i łączną cenę wszystkich produktów;<br />- cenę zamówienia = cena łączna produktów + koszty wykonania umowy (m.in. płatności i dostawy);<br />- formę dostawy – w tym termin, w którym nastąpi dostawa i jeżeli są jakiekolwiek ograniczenia dot. dostawy np. ciężaru bądź lokalizacji;<br />- sposób płatności;<br />- informację o prawie odstąpienia od umowy bez podania przyczyny w ciągu 14 dni;<br />- informację o prawie do rękojmi;<br />- w załączniku przesyłany jest wzór odstąpienia od umowy w ciągu 14 dni.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep dopuszcza możliwość odbioru osobistego w siedzibie firmy.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">VI. Forma płatności</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient ma możliwość dokonania zapłaty za towar tytułem złożonego zamówienia w formie:<br />- przelewu bankowego;<br />- gotówką przy odbiorze osobistym<br />- za pobraniem<br />- zapłaty za pośrednictwem systemu płatności Przelewy24</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Użytkownik zobowiązany jest podać prawdziwe dane do faktury VAT.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">VII. Ceny</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Wszystkie znajdujące się w sklepie internetowym oferty stanowią jedynie niezobowiązujące zaproszenie dla Klienta do przedłożenia odpowiedniej oferty kupna.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Ceny podane przy produktach na stronie WWW Sklepu podawane są w złotych zawierają podatki i opłaty. Cena produktu przed oznaczeniem przycisku „do koszyka” nie zawiera kosztów przesyłki i innych dodatkowych opłat. Koszty przesyłki oraz dokonania płatności doliczane są do sumy zamawianych produktów. Klient jest informowany przed złożeniem zamówienia o dodatkowych kosztach np. związanych z opakowaniem.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Ceną ostateczną zamówienia, wiążącą Sklep i Klienta jest cena produktu podana na stronie Sklepu przed złożeniem zamówienia przez Klienta, wraz z wszystkimi kosztami związanymi z realizacją umowy.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Informacja na temat całkowitej wartości zamówienia (wraz z kosztami przesyłki, dokonania płatności) udostępniana jest przed wyborem opcji „Zamawiam – transakcja z obowiązkiem zapłaty” oraz potwierdzana jest w przesłanej niezwłocznie wiadomości e-mail na adres podany przez Klienta.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">VIII. Dostawa</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient dokonuje wyboru rodzaju dostawy dostępne na stronie Sklepu, są to:<br />- kurier;<br />- odbiór osobisty.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Termin dostawy to 30 dni, chyba, że termin dostawy został ustalony w sposób indywidualny. W razie przekroczenia terminu wskazanego w zdaniu poprzednim konsument ma prawo do wyznaczenia sprzedawcy dodatkowego czasu. Jeżeli towar nadal nie zostanie wydany kupujący może odstąpić od umowy.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Dostawy odbywają się w dni robocze, od poniedziałku do piątku. W weekendy i wolne dni od pracy dostawy nie są realizowane.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sprzedawca odpowiada za niebezpieczeństwo przypadkowej utraty lub uszkodzenia towaru do momentu, w którym Konsument go otrzyma, chyba że Konsument wybrał inną formę dostawy niż dostawy proponowane przez Sklep.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Kupujący w momencie odbioru przesyłki ma możliwość sprawdzić towar i w razie jakiejkolwiek szkody spisać protokół w obecności dostawcy. Spisanie protokołu nie stanowi warunku do złożenia reklamacji bądź skorzystania z uprawnienia do odstąpienia od umowy.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Towary dostarczane są na terenie Polski oraz innych krajów Unii Europejskiej.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">IX. Usługa Newslettera</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Usługa przesyłania Newslettera polega na przesyłaniu wszelkich informacji, drogą mailową, dotyczących działalności Sklepu.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient korzysta z usługi Newslettera w sposób dobrowolny.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient ma możliwość skorzystania z usługi przesyłania informacji w ramach Newslettera poprzez wpisanie adresu e-mail w pole Newsletter</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Na wpisany przez Klienta adres email zostanie przesłana wiadomość email z potwierdzeniem rozpoczęcia świadczenia usługi wraz z informacją: „Jeżeli chcesz zrezygnować z Newslettera”.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient w każdym czasie ma możliwość rezygnacji z usługi Newsletter poprzez zgłoszenie rezygnacji w mailu lub zmianę w ustawieniach swojego konta.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">X. Prawo odstąpienia od umowy</span></strong></p>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Niniejszy rozdział dotyczy Użytkowników korzystających ze Sklepu jako Konsumenci.</span></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Konsument może odstąpić od umowy bez podania przyczyny, składając w terminie 14 dni od dnia doręczenia mu produktu stosowne oświadczenie w jakiejkolwiek formie lub bez wydania pisemnego oświadczenia po prostu odsyłając produkt. Do zachowania powyższego terminu wystarczy wysłać oświadczenie/produkt przed jego upływem na adres MakArt S.C. Anna Makowska, Agnieszka Makowska ul.Fitznerów 2 41-100 Siemianowice Śl, adres email: sklep@</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl.pl.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Konsument wyraża wolę skorzystania z uprawnienia odstąpienia od umowy również poprzez odesłanie towaru, postępując zgodnie z procedurami wskazanymi w zd. 1 niniejszego rozdziału.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">W przypadku odstąpienia od umowy zawartej na odległość, umowa jest uważana za niezawartą. To, co strony świadczyły, ulega zwrotowi w stanie niezmienionym. Zwrot powinien nastąpić niezwłocznie, nie później niż w terminie 14 dni. Zakupiony towar należy zwrócić na poniższy adres: MakArt S.C. Anna Makowska, Agnieszka Makowska  ul. Fitznerów 2 41-100 Siemianowice Śl,.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Bezpośrednie koszty zwrotnego dostarczenia towaru w związku ze skorzystaniem z uprawnienia ponosi Konsument, chyba, że Sklep zgodził się je ponieść lub nie poinformował konsumenta o jego prawie odstąpienia od umowy.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">W przypadku odstąpienia Klienta od umowy, Sklep dokona zwrotu ceny produktu w ciągu 14 dni od daty otrzymania oświadczenia Konsumenta. Zwrot nastąpi na wskazany przez Konsumenta rachunek bankowy. Sklep wydaje pisemne poświadczenie o zwrocie świadczenia.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Konsument ma obowiązek zwrócić towar nie później niż 14 dni od dnia, w którym odstąpił od umowy, chyba że przedsiębiorca zaproponował, że sam odbierze rzecz. Do zachowania terminu wystarczy odesłanie towaru przed jego upływem.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:18pt;font-family:\'Times New Roman\', serif;\">Wzór oświadczenia o odstąpieniu od umowy znajduję się <a href=\"http://www.twojapasmanteria.pl/odstapienietp.pdf\"><span style=\"color:#0000ff;\">TUTAJ</span></a></span></strong></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Prawo odstąpienia od umowy zawartej na odległość nie przysługuje Konsumentowi w wypadkach:<br />- świadczeń o właściwościach określonych przez konsumenta w złożonym przez niego zamówieniu lub ściśle związanych z jego osobą;<br />- świadczeń, w której cena lub wynagrodzenie zależy od wahań na rynku finansowym, nad którymi przedsiębiorca nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od umowy;<br />- świadczeń, w których przedmiotem są rzeczy, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami;<br />- świadczeń, które są wyraźnie dostosowane do indywidualnych potrzeb konsumenta.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">XI. Prawo Konsumenta do rękojmi</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Produkty oferowane w Sklepie objęte są 24 miesięczną odpowiedzialnością sprzedawcy za niezgodność towaru z umową. Istnieje domniemanie, że jeżeli Konsument zgłosił rękojmie Sprzedawcy w ciągu 12 miesięcy od doręczenia produktu to wada produktu istniała już w chwili jego wydania.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Reklamacja na podstawie odpowiedzialności sprzedawcy za niezgodność towaru z umową powinna być przekazana m.in.<br />- listownie na adres: MakArt S.C. Anna Makowska, Agnieszka Makowska ul. Fitznerów 2 41-100 Siemianowice Śl,<br />- elektronicznie na adres: sklep@</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl.pl<br />- telefonicznie, nr tel.: 785821611 </span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">W reklamacji powinien znaleźć się dokładny opis rodzaju niezgodności, data jej wystąpienia, powinno być określone żądanie Konsumenta, nr zamówienia oraz dane kontaktowe, co ułatwi procedurę reklamacyjną.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep rozpatruje reklamacje niezwłocznie, najpóźniej w terminie 14 dni od otrzymania reklamacji wysłanej przez Klienta.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">W przypadku braku informacji o sposobie rozpatrzenia reklamacji, w terminie określonym w pkt.4, reklamację uznaje się za rozpatrzoną na korzyść Klienta.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">W przypadku uzasadnionej reklamacji, Klient może żądać doprowadzenia produktu do stanu zgodnego z umową, nieodpłatną naprawę lub wymianę produktu na nowy, obniżenia ceny lub istnieje możliwość odstąpienia od umowy. Sklep zwróci Klientów równowartość ceny całości dokonanej transakcji.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Odpowiedź w sprawię reklamacji jest wysyłana na podany przez Klienta adres e-mail, adres korespondencji.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep wydaje pisemne poświadczenie o zwrocie świadczenia.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Przykładowy formularz Reklamacyjny znajduję się</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"margin-left:36pt;line-height:normal;\"><strong><span style=\"font-size:18pt;font-family:\'Times New Roman\', serif;\"><a href=\"http://www.foset.pl/sklep/img/dodatkowe/reklamacja.pdf\"><span style=\"color:#0000ff;\">TUTAJ</span></a></span></strong></p>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">XII. Zasady przetwarzania danych osobowych kupujących</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Szczegółowe zasady przetwarzania danych osobowych Kupujących-osób fizycznych określone zostały w „Polityce prywatności”, stanowiącej Załącznik nr 2 do niniejszego Regulaminu.</span></li>\n</ol>\n<p> </p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><strong><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">XIII. Pozostałe</span></strong></p>\n<p> </p>\n<ol type=\"1\" start=\"1\">\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Regulamin jest dostępny pod adresem: www.</span> <span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">twojapasmanteria.pl.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Klient ma możliwość odczytu, ściągnięcia treści regulaminu na swoje Urządzenie oraz dokonania wydruku dokumentu.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Sklep dokona zmiany postanowień Regulaminu z ważnych powodów po uprzednim poinformowaniu Klientów poprzez publikację jednolitego tekstu Regulaminu na łamach Sklepu oraz wysłania jego treści na adres email wskazany przez Klienta. Zmieniony lub zmodyfikowany regulamin ma moc wiążącą, po spełnieniu pozostałych warunków przewidzianych prawem, jedynie dla stosunków prawnych powstałych po wejściu w życie zmian lub modyfikacji.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Zmiany regulaminu nie będą w żaden sposób naruszać praw nabytych Klientów korzystających ze Sklepu przed dniem wejścia w życie zmian.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Wszelkie spory powstałe na gruncie Regulaminu lub umów sprzedaży rozstrzygane będą w sposób polubowny lub przez właściwy sąd powszechny, z zastrzeżeniem pkt 6.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Jeżeli kupującym nie jest konsument, wszelkie spory powstałe na gruncie Regulaminu lub umów sprzedaży rozstrzygał będzie sąd polubowny lub sąd powszechny właściwy miejscowo dla siedziby Sklepu Internetowego.</span></li>\n<li class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:\'Times New Roman\', serif;\">Jeżeli kupującym NIE jest konsument, odpowiedzialność Sklepu Internetowego z tytułu rękojmi zostaje wyłączona.</span></li>\n</ol>\n<p></p>','regulamin-sklepu'),
(9,1,1,'O Nas','','','','\n<h3>O nas:</h3>\n<h3><br /><span style=\"font-size:10pt;\">Firma: MakArt S.C. Anna Makowska, Agnieszka Makowska </span><br /><br /><span style=\"font-size:10pt;\">Ul. Fitznerów 2</span><br /><span style=\"font-size:10pt;\">41-100 Siemianowice Śl</span><br /><br /><span style=\"font-size:10pt;\">Funkcjonujemy na polskim rynku nieprzerwanie od 1999 roku. </span></h3>\n<h3><span style=\"font-size:10pt;\">Prowadzimy e-sklep  dla pasjonatów robótek ręcznych  i nie tylko. W naszej ofercie znajdziecie między innymi włóczki, kordonki oraz akcesoria dziewiarskie. Wszystkie nasze produkty nabywamy bezpośrednio od importerów ciągle poszerzając naszą ofertę.</span></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3><span style=\"line-height:1.5em;font-size:10pt;\">Serdecznie zapraszamy.</span></h3>\n<h4><span style=\"font-size:10pt;\"> </span></h4>\n\n<p></p>','o-nas'),
(10,1,1,'Dla Nowo Zarejestrowanych Klientów','','','','\n<p><strong>Dla nowo zarejestrowanych klientów przygotowaliśmy prezent powitalny</strong>.</p>\n<p>Wystarczy się zarejestrować w naszym sklepie jako klient i wykorzystać kod rabatowy <span style=\"color:#ff0000;\"><span style=\"font-size:18.6667px;\">NOWY20</span></span>. Jest to kod jednorazowy, który upoważnia do 10% zniżki na zakupy. Kod ten można wykorzystać w dowolnym momencie np Jeśli Państwo złożyliście zamówienie  i kod nie został użyty można to zrobić w kolejnym zamówieniu. Proszę pamiętać, że kod jest jednorazowy i obniża wartość zamówienie tylko raz</p>\n<p>Serdecznie zapraszamy i<strong> zachęcamy do rejestracji.</strong></p>\n\n<p></p>','dla-nowo-zarejestrowanych-klientow'),
(11,1,1,'Wysyłki Zagraniczne','','','','<span style=\"line-height:1.5em;\">Jeśli mieszkają Państwo poza granicami Polski i chcecie dokonać zakupu w naszym sklepie to proszę złożyć zamówienie i wybrać opcję przesyłka zagraniczna. My prześlemy Państwu mailem informacje dotyczące kosztów wysyłki oraz link do płatności poprzez system PAYPAL ( to najłatwiejsza forma zapłaty bez dodatkowych kosztów). Można zapłacić również zwykłym przelewem</span>\n<h5><span>KOSZTY WYSYŁEK DO EUROPY:</span></h5>\n<h5> </h5>\n<h5>LIST POLECONY<br />do 500 gram - 20,60 zł<br />do 1000 gram- 34,60 zł </h5>\n<p> </p>\n<h5><span>USŁUGI PACZKOWE</span></h5>\n<h5><span>od 2kg – 62,00 zł</span></h5>\n<h5><span>do 3kg – 67,00 zł</span></h5>\n<h5><span>do 4kg – 75,00 zł</span></h5>\n<h5><span>do 5kg – 84,00 zł</span></h5>\n<h5><span>do 6kg – 86,00 zł</span></h5>\n<h5><span>do 7kg – 88,00 zł</span></h5>\n<h5><span>do 8kg – 90,00 zł</span></h5>\n<h5><span>do 9kg – 92,00 zł</span></h5>\n<h5><span>do 10kg – 95,00 zł</span></h5>\n<h5><span>do 11kg – 100,00 zł</span></h5>\n<h5><span>do 12kg – 105,00 zł</span></h5>\n<h5><span>do 13kg – 110,00 zł</span></h5>\n<h5><span>do 14kg – 116,00 zł</span></h5>\n<h5><span>do 15kg – 124,00 zł</span></h5>\n<h5><span>do 16 kg -127,00 zł </span></h5>\n<h5><span>do 17 kg- 131,00 zł</span></h5>\n<h5><span>do 18 kg – 136,00 zł</span></h5>\n<h5><span>do 19 kg – 141,00 zł</span></h5>\n<h5><span>do 20 kg – 146,00 zł</span></h5>\n<h5><span>Koszty wysyłek zagranicznych są zgodne z cennikiem Poczty Polskiej</span></h5>\n<h5><span style=\"color:#ff0000;\"><a href=\"http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html\"><span style=\"color:#ff0000;\">http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html</span></a></span></h5>\n<h5><span>Jeśli zamówienie przekracza 200 zł od kosztów przesyłki zagranicznej odliczamy 16,00 zł ( to koszt, który pokrywamy my na teranie naszego kraju )</span></h5>\n<h5><span>Wysyłamy Paczki do wszystkich krajów. Koszty wysyłki poza Europą można sprawdzić tutaj : <span style=\"color:#ff0000;\"><a href=\"http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html\"><span style=\"color:#ff0000;\">http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html</span></a></span></span></h5>\n\n<p></p>','wysylki-zagraniczne'),
(13,1,1,'Zamówienia I Wysyłka','','','','<p>w przypadku zmiany zamówienia, sposobu płatnosci lub dostawy prosimy o kontakt mailowy ( preferowany)</p>\n<p>sklep@twojapasmanteria,pl</p>\n<p>w szczególnych przypadkach : tel  601098546</p>\n<p><span style=\"line-height:1.5em;font-size:18px;\">Sposoby wysyłki, formy transportu</span></p>\n<p><strong>Wysyłka Twojej paczki</strong></p>\n<p>Generalnie paczki są nadawane w ciągu 3 dni od momentu otrzymania potwierdzenia wpływu płatności.</p>\n<p>Opłaty za wysyłkę oraz opakowanie są wliczone w koszty wysyłki.</p>\n<p>Paczki wysyłamy za pośrednictwem Poczty Polskiej bądz kuriera. Cenniki wysyłki uzależnione są ściśle od wagi towaru.</p>\n<p>Koszty wysyłki naliczne są automatycznie po dodaniu towaru do koszyka.</p>\n<p> <span style=\"line-height:1.5em;\">Stan realizacji zamówienia i przesyłki</span></p>\n<p>Możesz na bieżąco sprawdzić <a href=\"https://www.twojapasmanteria.pl/guest-tracking.php\">status realizacji zamówienia</a>:</p>\n<ul>\n<li>\n<p>Jeśli podczas zamówienia założyłeś konto - status sprawdzisz <a href=\"https://www.twojapasmanteria.pl/authentication.php\">po zalogowaniu się</a>.</p>\n</li>\n<li>\n<p>Jeśli nie zakładałeś konta - <a style=\"font-size:9pt;\" href=\"https://www.twojapasmanteria.pl/guest-tracking.php\">sprawdź bez logowania stan realizacji zamówienia</a>.</p>\n<p>(podając numer zamówienia oraz swój e-mail).</p>\n</li>\n</ul>\n<h3> </h3>\n<h3>ZAMÓWIENIE I WYSYŁKA</h3>\n<p> </p>\n<p>Zamówienia można składać <br /><br />- bezpośrednio na stronie naszego sklepu<br /><br />- na maila: sklep@twojapasmanteria.pl<br />Towar wysyłamy do 3 dni po zaksięgowaniu wpłaty na naszym koncie. </p>\n<p>Można odebrać zamówienie w naszym sklepie  który znajduje się na ulicy Fitznerów 2 w Siemianowicach <br /><br /></p>\n<h3><br />INFORMACJA DLA KLIENTÓW DETALICZNYCH</h3>\n<p><br />Warunkiem dokonania zakupu jest założenie konta w naszym sklepie internetowym, realizujemy tylko sprzedaż wysyłkową za pośrednictwem poczty lub kuriera „K-ex”. Przyjmowane zamówienia realizowane są do 3 dni roboczych po otrzymaniu wpłaty na nasze konto w serwisie www.platnosci.pl lub na nasze konto mBank</p>\n<p></p>\n<div class=\"content\"><strong>29 1140 2004 0000 3002 7733 3996</strong></div>\n<p><br /><br />Wysyłamy towary na nasz koszt jeżeli zamówienie przekracza <strong><span style=\"color:#ff9900;\">200 zł</span></strong> <br /><br /></p>\n<h3>ZWROTY I REKLAMACJE</h3>\n<p><br />Reklamacje należy składać do 14 dni roboczych po otrzymaniu towaru. <br />1. W przypadku uszkodzonego towaru wymieniamy go na nowy, a koszt wysyłki pokrywa sklep. <br />2. W przypadku nieuzasadnionej reklamacji, dokonujemy wymiany na nowy lub zwracamy pieniądze.  Należy odesłać do nas zwracane towary w stanie nienaruszonym. <br />3. Aby zwrócić towar lub wymienić, należy dołączyć oryginał paragonu.</p>\n<p>PROSIMY O WYPEŁNIENIE FORMULARZA ZWROTU TOWARU</p>\n<p><a href=\"http://tp2013.foset.pl/img/dodatkowe/foto/zwrot-towaru.pdf\"><img style=\"margin-left:auto;margin-right:auto;\" src=\"http://tp2013.foset.pl/img/dodatkowe/foto/pdf.gif\" alt=\"pdf\" width=\"100\" height=\"100\" /></a></p>\n<p>                                                                       FORMULARZ ZWROTU TOWARU DO POBRANIA </p>\n<h3><br /><br />KOSZTY WYSYŁKI</h3>\n<p> </p>\n<p><img src=\"http://www.foset.pl/tp/szablon2014/images/wysylka.jpg\" alt=\"wysylka\" /></p>\n<p> </p>\n<h3> Wysyłamy paczki zagranicę. Cennik paczek zagranicznych znajdziecie Państwo <span style=\"text-decoration:underline;\"><span style=\"color:#3366ff;\"><a href=\"http://twojapasmanteria.pl/index.php?id_cms=18&amp;controller=cms\"><span style=\"color:#3366ff;text-decoration:underline;\">TUTAJ </span></a></span></span></h3>\n<h3><span style=\"font-size:12px;font-weight:normal;line-height:1.5em;\"> </span></h3>\n<h3> </h3>\n<h3>DODATKOWE INFORMACJE</h3>\n<p><br />W przypadku, gdy przesyłka realizowana jest za pomocą kuriera \"K-ex\" klient może sprawdzać gdzie aktualnie znajduje się przesyłka na stronie http://www.k-ex.pl  po wpisaniu numeru przesyłki, który wysyłamy na życzenie mailem. <br />Klient jest informowany o każdym etapie realizacji zamówienia za pomocą maili. Może również sprawdzić stan realizacji zamówień na stronie naszego sklepu po zalogowaniu.</p>\n<p></p>','zamowienia-i-wysylka'),
(14,1,1,'Program Lojalnościowy','','','','<p><strong><span style=\"color:#ff9900;\">Od dnia 4.05.2013 utworzyliśmy w naszym sklepie PROGRAM LOJALNOŚCIOWY</span></strong></p>\n<p> </p>\n<p>Każdy zarejestrowany klient dokonując zakupów w naszym sklepie otrzymuje punkty, które w dowolnej chwili można zamienić na voucher  (BON)  uprawniający  do zniżki na kolejne zakupy  towarów.</p>\n<p>Stan punktów można sprawdzić w zakładce „ Moje konto” dalej klikając na „ Punkty lojalnościowe”. Po otrzymaniu dla Państwa  wystarczającej  ilości punktów można przekształcić je na voucher (BON). Automatycznie poniżej pojawi się kupon rabatowy z kodem, kwotą  oraz datą od kiedy do kiedy może zostać wykorzystany.</p>\n<p>SPOSÓB NALICZANIA PUNKTÓW:</p>\n<p>1 zł = 1 pkt = 0,03 zł</p>\n<p>Punkt naliczany jest od wartości jednostkowej produktu.</p>\n<p> </p>\n<p>PRZYKŁAD:</p>\n<p>Dnia 10 maja złożono zamówienie:            </p>\n<p>Maxi 1 sztuka 12,50 zł  = 12 pkt</p>\n<p>Dora 10 szttuk x 6,50  =  60 pkt</p>\n<p>Dnia 5 czerwca złożono zamówienie:         </p>\n<p>Etamin 30 sztuk x 2,90 = 60 pkt</p>\n<p>Dnia 28 czerwca złożono zamówienie:       </p>\n<p>Camilla 15 sztuk x 6,40 = 90 pkt</p>\n<p>Dnia 8 lipca złożono zamówienie :             </p>\n<p>Jeans 30 sztuk x 5,40 = 162 pkt</p>\n<p>Dnia 20 lipca złożono zamówienie:            </p>\n<p>Mercan Batik 18 sztuk x 12,90 = 216 pkt</p>\n<p> </p>\n<p>DO DNIA 20 LIPCA STAN  PUNKTÓW WYNOSI = 600pkt x0,03= 18,00 zł</p>\n<p>Kwotę  można wykorzystać przy następnym  zamówieniu  lub nadal zbierać punkty.</p>\n<p> </p>\n<p>WAŻNE:</p>\n<p>Punktu naliczane są gdy status zamówionego towaru zostanie zmieniony w naszym systemie na wysyłkę.</p>\n<p>Jeśli klient zrezygnuje z zakupionego towaru i odeśle zamówienie, punkty automatycznie zostaną anulowane.</p>\n<p>PUNKTY SĄ NALICZANE TYLKO PRZY ZAKUPACH W SKLEPIE INTERNETOWYM</p>\n<p>W sklepie stacjonarnym obowiązują karty rabatowe, które mogą być wymienione na 5% zniżkę. Więcej szczegółów przekaże obsługa sklepu. </p>\n<p> </p>\n<p>Serdecznie zapraszamy </p>\n<p></p>','program-lojalnosciowy'),
(15,1,1,'ZWROTY I REKLAMACJE','','','','<h2>ZWROTY I REKLAMACJE</h2>\n<p>Klient ma prawo zrezygnować z nie wysłanego jeszcze zamówienia poprzez email lub telefonicznie</p>\n<p>Zwrot towaru bez podania przyczyny</p>\n<p>ustawa o prawach konsumenta z dnia 30 maja 2014 r. (Dz.U. 2014 r. poz. 827 ze zm.)</p>\n<p>Klient ma prawo zwrócić towar bez podania przyczyny w ciągu 14 dni kalendarzowych. W tym celu należy wypełnić FORMULARZ . Zwracany towar nie może być uszkodzony i musi być dołączony dowód zakupu. Klient również ponosi  odpowiedzialność za zmniejszenie wartości produktów .Pieniądze za towar są zwracane konsumentowi w ciągu 14 dni od otrzymanego towaru. Dokonujemy zwrotu płatności  na rachunek bankowy, chyba, że strony uzgodniły inaczej. <strong>Konsument ponosi bezpośrednie koszty zwrotu Produktu</strong> (czyli koszt odesłania produktów do nas), chyba że Sprzedawca zgodził się je ponieść lub nie poinformował konsumenta o konieczności poniesienia tych kosztów.</p>\n<p> </p>\n<p>Wszystkie reklamacje rozpatrywane są wciągu 14 dni kalendarzowych. Towar uszkodzony z naszej winy  wymieniany jest na ten sam lub inny jeśli strony tak uzgodnią. Jeśli okazało by się, że wymiana jest niemożliwa z przyczyny braku towaru do wymiany  niezwłocznie dokonujemy zwrotu pieniędzy.</p>\n<p>Bardzo prosimy do zwracanego towaru dołączyć FORMULARZ. Jeśli nie macie Państwo możliwości wydrukowania prosimy odręcznie napisać wszystkie niezbędne dla nas informacje. Bez tego zwrot gotówki lub wymiana może się opóźnić.</p>\n<p>                                                                                          FORMULARZ DO POBRANIA </p>\n<p><a href=\"http://tp2013.foset.pl/img/dodatkowe/foto/zwrot-towaru.pdf\"><img style=\"margin-left:auto;margin-right:auto;\" src=\"http://tp2013.foset.pl/img/dodatkowe/foto/pdf.gif\" alt=\"pdf\" width=\"120\" height=\"120\" /></a></p>\n<p> </p>\n<p>Wszytkie zwroty proszę odsyłać na adres</p>\n<p>MakArt \" Świat włóczek\"</p>\n<p>Fitznerów 2</p>\n<p>41-100 Siemianowcie Śl</p>\n<p></p>','zwroty-i-reklamacje'),
(16,1,1,'Wysyłki Zagraniczne','','','','\n<h5><span style=\"line-height:1.5em;\">Jeśli mieszkają Państwo poza granicami Polski i chcecie dokonać zakupu w naszym sklepie to proszę złożyć zamówienie i wybrać opcję przesyłka zagraniczna. My prześlemy Państwu mailem informacje dotyczące kosztów wysyłki oraz link do płatności poprzez system PAYPAL ( to najłatwiejsza forma zapłaty bez dodatkowych kosztów). Można zapłacić również zwykłym przelewem</span></h5>\n<h5><span>KOSZTY WYSYŁEK DO EUROPY:</span></h5>\n<h5> </h5>\n<h5>LIST POLECONY<br />do 500 gram - 20,60 zł<br />do 1000 gram- 34,60 zł </h5>\n<p> </p>\n<h5><span>USŁUGI PACZKOWE</span></h5>\n<h5><span>od 2kg – 62,00 zł</span></h5>\n<h5><span>do 3kg – 67,00 zł</span></h5>\n<h5><span>do 4kg – 75,00 zł</span></h5>\n<h5><span>do 5kg – 84,00 zł</span></h5>\n<h5><span>do 6kg – 86,00 zł</span></h5>\n<h5><span>do 7kg – 88,00 zł</span></h5>\n<h5><span>do 8kg – 90,00 zł</span></h5>\n<h5><span>do 9kg – 92,00 zł</span></h5>\n<h5><span>do 10kg – 95,00 zł</span></h5>\n<h5><span>do 11kg – 100,00 zł</span></h5>\n<h5><span>do 12kg – 105,00 zł</span></h5>\n<h5><span>do 13kg – 110,00 zł</span></h5>\n<h5><span>do 14kg – 116,00 zł</span></h5>\n<h5><span>do 15kg – 124,00 zł</span></h5>\n<h5><span>do 16 kg -127,00 zł </span></h5>\n<h5><span>do 17 kg- 131,00 zł</span></h5>\n<h5><span>do 18 kg – 136,00 zł</span></h5>\n<h5><span>do 19 kg – 141,00 zł</span></h5>\n<h5><span>do 20 kg – 146,00 zł</span></h5>\n<h5><span>Koszty wysyłek zagranicznych są zgodne z cennikiem Poczty Polskiej</span></h5>\n<h5><span style=\"color:#ff0000;\"><a href=\"http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html\"><span style=\"color:#ff0000;\">http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html</span></a></span></h5>\n<h5><span>Jeśli zamówienie przekracza 200 zł od kosztów przesyłki zagranicznej odliczamy 16,00 zł ( to koszt, który pokrywamy my na teranie naszego kraju )</span></h5>\n<h5><span>Wysyłamy Paczki do wszystkich krajów. Koszty wysyłki poza Europą można sprawdzić tutaj : <span style=\"color:#ff0000;\"><a href=\"http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html\"><span style=\"color:#ff0000;\">http://cennik.poczta-polska.pl/usluga,zagraniczny_przesylka_listowa.html</span></a></span></span></h5>\n\n<p></p>','wysylki-zagraniczne'),
