INSERT INTO `ps_product_lang` VALUES
(3,1,1,'<p>\n\n</p><p>Włóczka <b>BABY YarnArt</b> to doskonały wybór dla wszystkich miłośników\nrękodzieła, którzy pragną stworzyć niezwykle przyjemne w dotyku i delikatne\nwyroby dla najmłodszych i nie tylko. Ta wyjątkowa włóczka zachwyca swoją\nmiękkością i puszystością, sprawiając, że każda robótka jest przyjemna w\nużytkowaniu.</p><p>Motek tej włóczki waży 50 gramów i zawiera aż 150 metrów nici, co oznacza,\nże jest wydajna i idealna do tworzenia różnorodnych projektów. Zalecane druty\ndo pracy z nią to <b>3,5 mm</b>, a także zalecane szydełko o tej samej\ngrubości. Dzięki tym wskazówkom można łatwo osiągnąć pożądany efekt i stworzyć\npiękne wyroby. </p><p>Włóczka <b>BABY YarnArt</b> dostępna jest w bogatej i żywej kolorystyce,\nobejmującej aż 45 różnorodnych odcieni.</p><p><b>Skład</b>: 100% akryl</p><p><b>Motek</b>: 50 gram - 150 mb</p><p><b>Zalecane druty</b>: 3,5 mm</p><p><b>Zalecane szydełko</b>: 3,5 mm</p><br />','','wloczka-baby-yarnart-156-czerwony','','','','włóczka Baby YarnArt 156 czerwony','','','',''),
(4,1,1,'<p>Włóczka Adore YarnArt Antypilling </p><p>Włóczka akrylowa z delikatnym połyskiem odporna na mechacenie</p><p>Skład: 100 % akryl antypilling </p><p>1 motek: 100 gram / 280 m</p><p>Zalecane szydełko: 4 mm</p><p>Zalecane druty: 4 mm</p><p></p><p></p>','','wloczka-adore-kolor-bialy-330','','','','Włóczka Adore kolor biały 330','','','',''),
(5,1,1,'<p>\n\n</p><p><b>Włóczka PUNCH</b> Mikroakrylowa z Jedwabistym Połyskiem</p><p>Włóczka wykonana z wysokiej jakości mikroakrylu, z jedwabistym połyskiem i delikatnością w dotyku. Ta wyjątkowa włóczka jest nie tylko miękka i przyjemna w użyciu, ale również idealna do różnorodnych technik, w tym do haftowania metodą Punch Needle oraz tradycyjnych wyrobów szydełkowych.</p><p>Najważniejsze cechy:</p><p><b>Jedwabisty Połysk</b>: Dzięki specjalnej obróbce, włóczka ma charakterystyczny jedwabisty połysk, dodając elegancji i wyrafinowania Twoim projektom.</p><p><b>Miękkość i Delikatność</b>: Włóczka jest niezwykle miękka w dotyku, co sprawia, że praca z nią jest przyjemna i komfortowa dla rąk.</p><p><b>Uniwersalne Zastosowanie</b>: Nadaje się do techniki haftowania Punch Needle oraz tradycyjnych wyrobów szydełkowych, dając nieograniczone możliwości tworzenia unikatowych projektów.</p><p><b>Skład</b>: Wykonana w 100% z mikroakrylu, gwarantującego trwałość i odporność na ścieranie.</p><p><b>Parametry</b>: Każdy motek waży 25 gramów i ma długość 70 metrów.</p><p><b>Zalecane Narzędzia</b>: Do pracy z tą włóczką zalecane są druty o grubości 3 mm - 4 mm oraz szydełko o tej samej grubości.</p><p>Punch Needle - Nowoczesna Technika Haftowania:</p><p>Punch Needle to innowacyjna i prosta technika haftowania, która otwiera przed Tobą nieograniczone możliwości twórcze. Wystarczy opanować kilka prostych ruchów, by móc tworzyć poduszki, organizery na ścianę, osłonki na doniczki, dywaniki, niepowtarzalne torebki i wiele innych efektownych dekoracji, które nadadzą Twojemu domowi niepowtarzalny charakter. Z włóczką mikroakrylową z jedwabistym połyskiem Twoje projekty nabiorą elegancji i wyjątkowego uroku.</p><p><b>Producen</b>t: Etrofil</p><p><b>Skład</b>: Mikroakryl</p><p><b>Motek</b>: 25 gram</p><p><b>Długość</b>: 70 metrów</p><p><b>Zlecane druty i szydeł</b>ko: 3-4 mm</p><br />','','wloczka-punch-etrofil-72104','','','','Włóczka Punch ETROFIL 72104','','','',''),
(6,1,1,'<p>\n\n</p><p>Włóczka <b>BABY YarnArt</b> to doskonały wybór dla wszystkich miłośników\nrękodzieła, którzy pragną stworzyć niezwykle przyjemne w dotyku i delikatne\nwyroby dla najmłodszych i nie tylko. Ta wyjątkowa włóczka zachwyca swoją\nmiękkością i puszystością, sprawiając, że każda robótka jest przyjemna w\nużytkowaniu.</p><p>Motek tej włóczki waży 50 gramów i zawiera aż 150 metrów nici, co oznacza,\nże jest wydajna i idealna do tworzenia różnorodnych projektów. Zalecane druty\ndo pracy z nią to <b>3,5 mm</b>, a także zalecane szydełko o tej samej\ngrubości. Dzięki tym wskazówkom można łatwo osiągnąć pożądany efekt i stworzyć\npiękne wyroby. </p><p>Włóczka <b>BABY YarnArt</b> dostępna jest w bogatej i żywej kolorystyce,\nobejmującej aż 45 różnorodnych odcieni.</p><p><b>Skład</b>: 100% akryl</p><p><b>Motek</b>: 50 gram - 150 mb</p><p><b>Zalecane druty</b>: 3,5 mm</p><p><b>Zalecane szydełko</b>: 3,5 mm</p><br />','','wloczka-baby-yarnart-174-ostry-roz','','','','włóczka Baby YarnArt 174 ostry róż','','','',''),
(7,1,1,'<p>Włóczka Adore YarnArt Antypilling </p><p>Włóczka akrylowa z delikatnym połyskiem odporna na mechacenie</p><p>Skład: 100 % akryl antypilling </p><p>1 motek: 100 gram / 280 m</p><p>Zalecane szydełko: 4 mm</p><p>Zalecane druty: 4 mm</p><p></p><p></p>','','wloczka-adore-kolor-ecru-331','','','','Włóczka Adore kolor ecru 331','','','',''),
(8,1,1,'<p>\n\n</p><p><b>Włóczka PUNCH</b> Mikroakrylowa z Jedwabistym Połyskiem</p><p>Włóczka wykonana z wysokiej jakości mikroakrylu, z jedwabistym połyskiem i delikatnością w dotyku. Ta wyjątkowa włóczka jest nie tylko miękka i przyjemna w użyciu, ale również idealna do różnorodnych technik, w tym do haftowania metodą Punch Needle oraz tradycyjnych wyrobów szydełkowych.</p><p>Najważniejsze cechy:</p><p><b>Jedwabisty Połysk</b>: Dzięki specjalnej obróbce, włóczka ma charakterystyczny jedwabisty połysk, dodając elegancji i wyrafinowania Twoim projektom.</p><p><b>Miękkość i Delikatność</b>: Włóczka jest niezwykle miękka w dotyku, co sprawia, że praca z nią jest przyjemna i komfortowa dla rąk.</p><p><b>Uniwersalne Zastosowanie</b>: Nadaje się do techniki haftowania Punch Needle oraz tradycyjnych wyrobów szydełkowych, dając nieograniczone możliwości tworzenia unikatowych projektów.</p><p><b>Skład</b>: Wykonana w 100% z mikroakrylu, gwarantującego trwałość i odporność na ścieranie.</p><p><b>Parametry</b>: Każdy motek waży 25 gramów i ma długość 70 metrów.</p><p><b>Zalecane Narzędzia</b>: Do pracy z tą włóczką zalecane są druty o grubości 3 mm - 4 mm oraz szydełko o tej samej grubości.</p><p>Punch Needle - Nowoczesna Technika Haftowania:</p><p>Punch Needle to innowacyjna i prosta technika haftowania, która otwiera przed Tobą nieograniczone możliwości twórcze. Wystarczy opanować kilka prostych ruchów, by móc tworzyć poduszki, organizery na ścianę, osłonki na doniczki, dywaniki, niepowtarzalne torebki i wiele innych efektownych dekoracji, które nadadzą Twojemu domowi niepowtarzalny charakter. Z włóczką mikroakrylową z jedwabistym połyskiem Twoje projekty nabiorą elegancji i wyjątkowego uroku.</p><p><b>Producen</b>t: Etrofil</p><p><b>Skład</b>: Mikroakryl</p><p><b>Motek</b>: 25 gram</p><p><b>Długość</b>: 70 metrów</p><p><b>Zlecane druty i szydeł</b>ko: 3-4 mm</p><br />','','wloczka-punch-etrofil-72107','','','','Włóczka Punch ETROFIL 72107','','','',''),
(9,1,1,'<p></p><p>Włóczka <b>BABY YarnArt</b> to doskonały wybór dla wszystkich miłośników rękodzieła, którzy pragną stworzyć niezwykle przyjemne w dotyku i delikatne wyroby dla najmłodszych i nie tylko. Ta wyjątkowa włóczka zachwyca swoją miękkością i puszystością, sprawiając, że każda robótka jest przyjemna w użytkowaniu.</p><p>Motek tej włóczki waży 50 gramów i zawiera aż 150 metrów nici, co oznacza, że jest wydajna i idealna do tworzenia różnorodnych projektów. Zalecane druty do pracy z nią to <b>3,5 mm</b>, a także zalecane szydełko o tej samej grubości. Dzięki tym wskazówkom można łatwo osiągnąć pożądany efekt i stworzyć piękne wyroby.</p><p>Włóczka <b>BABY YarnArt</b> dostępna jest w bogatej i żywej kolorystyce, obejmującej aż 45 różnorodnych odcieni.</p><p><b>Skład</b>: 100% akryl</p><p><b>Motek</b>: 50 gram - 150 mb</p><p><b>Zalecane druty</b>: 3,5 mm</p><p><b>Zalecane szydełko</b>: 3,5 mm</p><p></p>','','wloczka-baby-yarnart-195-szary','','','','włóczka Baby YarnArt 195 szary','','','',''),
(10,1,1,'<p>Włóczka Adore YarnArt Antypilling </p><p>Włóczka akrylowa z delikatnym połyskiem odporna na mechacenie</p><p>Skład: 100 % akryl antypilling </p><p>1 motek: 100 gram / 280 m</p><p>Zalecane szydełko: 4 mm</p><p>Zalecane druty: 4 mm</p><p></p><p></p>','','wloczka-adore-kolor-bez-335','','','','Włóczka Adore kolor beż 335','','','',''),
(11,1,1,'<p>\n\n</p><p><b>Włóczka PUNCH</b> Mikroakrylowa z Jedwabistym Połyskiem</p><p>Włóczka wykonana z wysokiej jakości mikroakrylu, z jedwabistym połyskiem i delikatnością w dotyku. Ta wyjątkowa włóczka jest nie tylko miękka i przyjemna w użyciu, ale również idealna do różnorodnych technik, w tym do haftowania metodą Punch Needle oraz tradycyjnych wyrobów szydełkowych.</p><p>Najważniejsze cechy:</p><p><b>Jedwabisty Połysk</b>: Dzięki specjalnej obróbce, włóczka ma charakterystyczny jedwabisty połysk, dodając elegancji i wyrafinowania Twoim projektom.</p><p><b>Miękkość i Delikatność</b>: Włóczka jest niezwykle miękka w dotyku, co sprawia, że praca z nią jest przyjemna i komfortowa dla rąk.</p><p><b>Uniwersalne Zastosowanie</b>: Nadaje się do techniki haftowania Punch Needle oraz tradycyjnych wyrobów szydełkowych, dając nieograniczone możliwości tworzenia unikatowych projektów.</p><p><b>Skład</b>: Wykonana w 100% z mikroakrylu, gwarantującego trwałość i odporność na ścieranie.</p><p><b>Parametry</b>: Każdy motek waży 25 gramów i ma długość 70 metrów.</p><p><b>Zalecane Narzędzia</b>: Do pracy z tą włóczką zalecane są druty o grubości 3 mm - 4 mm oraz szydełko o tej samej grubości.</p><p>Punch Needle - Nowoczesna Technika Haftowania:</p><p>Punch Needle to innowacyjna i prosta technika haftowania, która otwiera przed Tobą nieograniczone możliwości twórcze. Wystarczy opanować kilka prostych ruchów, by móc tworzyć poduszki, organizery na ścianę, osłonki na doniczki, dywaniki, niepowtarzalne torebki i wiele innych efektownych dekoracji, które nadadzą Twojemu domowi niepowtarzalny charakter. Z włóczką mikroakrylową z jedwabistym połyskiem Twoje projekty nabiorą elegancji i wyjątkowego uroku.</p><p><b>Producen</b>t: Etrofil</p><p><b>Skład</b>: Mikroakryl</p><p><b>Motek</b>: 25 gram</p><p><b>Długość</b>: 70 metrów</p><p><b>Zlecane druty i szydeł</b>ko: 3-4 mm</p><br />','','wloczka-punch-etrofil-72106','','','','Włóczka Punch ETROFIL 72106','','','',''),
