(51,1,1,'<p>\n\n</p><p>Włóczka <b>BABY YarnArt</b> to doskonały wybór dla wszystkich miłośników\nrękodzieła, którzy pragną stworzyć niezwykle przyjemne w dotyku i delikatne\nwyroby dla najmłodszych i nie tylko. Ta wyjątkowa włóczka zachwyca swoją\nmiękkością i puszystością, sprawiając, że każda robótka jest przyjemna w\nużytkowaniu.</p><p>Motek tej włóczki waży 50 gramów i zawiera aż 150 metrów nici, co oznacza,\nże jest wydajna i idealna do tworzenia różnorodnych projektów. Zalecane druty\ndo pracy z nią to <b>3,5 mm</b>, a także zalecane szydełko o tej samej\ngrubości. Dzięki tym wskazówkom można łatwo osiągnąć pożądany efekt i stworzyć\npiękne wyroby. </p><p>Włóczka <b>BABY YarnArt</b> dostępna jest w bogatej i żywej kolorystyce,\nobejmującej aż 45 różnorodnych odcieni.</p><p><b>Skład</b>: 100% akryl</p><p><b>Motek</b>: 50 gram - 150 mb</p><p><b>Zalecane druty</b>: 3,5 mm</p><p><b>Zalecane szydełko</b>: 3,5 mm</p><br />','','wloczka-baby-yarnart-600-niebieski','','','','włóczka Baby YarnArt 600 niebieski','','','',''),
