(61,1,1,'<p></p><p><b>Włóczka PUNCH</b> Mikroakrylowa z Jedwabistym Połyskiem</p><p>Włóczka wykonana z wysokiej jakości mikroakrylu, z jedwabistym połyskiem i delikatnością w dotyku. Ta wyjątkowa włóczka jest nie tylko miękka i przyjemna w użyciu, ale również idealna do różnorodnych technik, w tym do haftowania metodą Punch Needle oraz tradycyjnych wyrobów szydełkowych.</p><p>Najważniejsze cechy:</p><p><b>Jedwabisty Połysk</b>: Dzięki specjalnej obróbce, włóczka ma charakterystyczny jedwabisty połysk, dodając elegancji i wyrafinowania Twoim projektom.</p><p><b>Miękkość i Delikatność</b>: Włóczka jest niezwykle miękka w dotyku, co sprawia, że praca z nią jest przyjemna i komfortowa dla rąk.</p><p><b>Uniwersalne Zastosowanie</b>: Nadaje się do techniki haftowania Punch Needle oraz tradycyjnych wyrobów szydełkowych, dając nieograniczone możliwości tworzenia unikatowych projektów.</p><p><b>Skład</b>: Wykonana w 100% z mikroakrylu, gwarantującego trwałość i odporność na ścieranie.</p><p><b>Parametry</b>: Każdy motek waży 25 gramów i ma długość 70 metrów.</p><p><b>Zalecane Narzędzia</b>: Do pracy z tą włóczką zalecane są druty o grubości 3 mm - 4 mm oraz szydełko o tej samej grubości.</p><p>Punch Needle - Nowoczesna Technika Haftowania:</p><p>Punch Needle to innowacyjna i prosta technika haftowania, która otwiera przed Tobą nieograniczone możliwości twórcze. Wystarczy opanować kilka prostych ruchów, by móc tworzyć poduszki, organizery na ścianę, osłonki na doniczki, dywaniki, niepowtarzalne torebki i wiele innych efektownych dekoracji, które nadadzą Twojemu domowi niepowtarzalny charakter. Z włóczką mikroakrylową z jedwabistym połyskiem Twoje projekty nabiorą elegancji i wyjątkowego uroku.</p><p><b>Producen</b>t: Etrofil</p><p><b>Skład</b>: Mikroakryl</p><p><b>Motek</b>: 25 gram</p><p><b>Długość</b>: 70 metrów</p><p><b>Zlecane druty i szydełko</b>: 3-4 mm</p><p></p>','','wloczka-punch-etrofil-73216','','','','Włóczka Punch ETROFIL 73216','','','',''),
(62,1,1,'<p></p><p>Włóczka <b>BABY YarnArt</b> to doskonały wybór dla wszystkich miłośników rękodzieła, którzy pragną stworzyć niezwykle przyjemne w dotyku i delikatne wyroby dla najmłodszych i nie tylko. Ta wyjątkowa włóczka zachwyca swoją miękkością i puszystością, sprawiając, że każda robótka jest przyjemna w użytkowaniu.</p><p>Motek tej włóczki waży 50 gramów i zawiera aż 150 metrów nici, co oznacza, że jest wydajna i idealna do tworzenia różnorodnych projektów. Zalecane druty do pracy z nią to <b>3,5 mm</b>, a także zalecane szydełko o tej samej grubości. Dzięki tym wskazówkom można łatwo osiągnąć pożądany efekt i stworzyć piękne wyroby.</p><p>Włóczka <b>BABY YarnArt</b> dostępna jest w bogatej i żywej kolorystyce, obejmującej aż 45 różnorodnych odcieni.</p><p><b>Skład</b>: 100% akryl</p><p><b>Motek</b>: 50 gram - 150 mb</p><p><b>Zalecane druty</b>: 3,5 mm</p><p><b>Zalecane szydełko</b>: 3,5 mm</p><p></p>','','wloczka-baby-yarnart-3024-ciemna-czerwien','','','','włóczka Baby YarnArt 3024 ciemna czerwień','','','',''),
