(105,1,1,'<p></p><p class=\"MsoNormal\">Happy Feet to <span> </span>ręcznie farbowana wełna merino superwash z dodatkiem poliamidu o nasycanych barwach. <span> </span>Doskonale sprawdzi się w wyrobach takich jak skarpety, szaliki, rękawiczki oraz czapki </p><p></p><p class=\"MsoNormal\">Posiada certyfikat OEKO – TEX Standard 100 </p><p></p><p class=\"MsoNormal\">Skład: 75% wełna merino superwash, 25% poliamid</p><p></p><p class=\"MsoNormal\">1 motek: 100 gram / 330 m</p><p></p><p class=\"MsoNormal\">Zalecane druty: 2,5 mm – 3 mm</p><p></p><p class=\"MsoNormal\">Zalecane szydełko: 4 mm – 5 mm </p><p></p><p class=\"MsoNormal\"></p><p> </p><p class=\"MsoNormal\">Do prania zalecamy specjalne preparaty do wełny. Nie należy używać płynów do płukania. Prać w <span style=\"font-size:10pt;line-height:107%;font-family:\'Open Sans\', sans-serif;color:#111111;background:#FFFFFF;\">30ºC</span> <span> </span>bez wirowania. Suszyć na leżąco. </p><p></p><p class=\"MsoNormal\"></p><p> </p><p class=\"MsoNormal\">Wydajność: 1 motek = 1 para skarpet rozmiar 40 </p><p></p><p class=\"MsoNormal\">Z uwagi na to, że włóczka jest ręcznie barwiona nie posiada numeru partii</p><p></p><p class=\"MsoNormal\"> <img src=\"https://www.twojapasmanteria.pl/img/cms/a/ikony.jpg\" alt=\"ikony\" width=\"273\" height=\"53\" />             </p><p class=\"MsoNormal\"><img src=\"https://www.twojapasmanteria.pl/img/cms/baner.jpg\" width=\"1100\" height=\"338\" alt=\"baner.jpg\" /></p><p></p>','','wloczka-happy-feet-3241','','','','Włóczka Happy Feet 3241','','','',''),
