(134,1,1,'<p class=\"MsoNormal\">Ta fantazyjna włóczka to prawdziwe cudo dla miłośników dziergania! Jest niezwykle miękka i puszysta, idealna do tworzenia włochatych, ciepłych czapek, szalików, swetrów, bezrękawników, kamizelek. Jej unikalna tekstura sprawia, że każdy wytworzony z niej wyrób jest nie tylko komfortowe, ale i niezwykle atrakcyjne wizualnie.</p><p>Włóczka ta doskonale nadaje się również do eksperymentowania z kreatywnymi projektami. Można z niej zrobić efektowne wstawki na środku swetra, pod szyją lub na brzegach, dodając tym samym odrobinę luksusu i oryginalności do standardowych ubrań. Dzięki swojej bogatej palecie kolorów i tekstur, inspiruje do tworzenia niebanalnych wzorów, które ożywią każdą, nawet najprostszą kreację. Idealna dla tych, którzy chcą dodać swoim projektom trochę magii i wyjątkowości!</p><p></p><p class=\"MsoNormal\">Skład: 40% wełna merino, 60% poliamid</p><p class=\"MsoNormal\">1 motek: 50 gram-150 metrów</p><p class=\"MsoNormal\">Zalecane druty: 3 mm</p><p class=\"MsoNormal\">Zalecane szydełko: 2,5mm-3 mm </p><p class=\"MsoNormal\"><img src=\"https://www.twojapasmanteria.pl/img/cms/a/ikony.jpg\" alt=\"ikony\" width=\"330\" height=\"64\" /></p><p></p><p></p>','','wloczka-teddy-gazzal-kolor-szaro-zielony-6535','','','','Włóczka Teddy Gazzal kolor szaro-zielony 6535','','','',''),
(135,1,1,'<p></p><p>Merino Bulky to mieszanka wełny i akrylu </p><p>Ładnie skręcona nitka o gładkiej fakturze z delikatnym połyskiem</p><p>Pomimo zawartości wełny włóczka nie gryzie!</p><p>Doskonale sprawdzi się w dzierganiu czapek, kominów oraz ciepłych swetrów</p><p>Skład: 25% wełna, 75% akryl</p><p>1 motek: 100 gram - 100 metrów</p><p>Zalecane druty: 7 mm</p><p>Zalecane szydełko: 8 mm</p><br />','','wloczka-merino-bulky-kolor-577-bordo','','','','Włóczka Merino Bulky kolor 577 bordo','','','',''),
