(225,1,1,'<p></p><p><b>Włóczka Baby Cotton Gazzal</b> to doskonały wybór dla\nosób poszukujących delikatnego i miękkiego włókna do wyrobów dla najmłodszych i\nnie tylko. Wykonana z wysokiej jakości mieszanki bawełny i poliakrylu, ta\nwłóczka charakteryzuje się niezwykłą delikatnością i wydajnością.</p><p>Jej miękkość sprawia, że idealnie nadaje się do wyrobu\nczapeczek, kocyków i sweterków dla niemowląt, zapewniając im komfort noszenia i\ndelikatne uczucie na skórze. Dodatkowo, dzięki swojej konstrukcji, świetnie\nsprawdzi się również w tworzeniu uroczych amigurumi, dodając im subtelnego\nuroku i przyjemnej tekstury.</p><p>Włóczka jest dostępna w pięknej pastelowej kolorystyce</p><p><b>Skład włóczki to 60% bawełny i 40% poliakrylu</b>, co\nzapewnia trwałość i łatwość w pielęgnacji wyrobów. Każdy <b>motek waży 50\ngramów i ma długość 165 metrów</b>, co czyni go wyjątkowo wydajnym. <b>Zalecane\nrozmiary drutów to 3,5 mm, a szydełka od 2 mm do 4 mm</b>, co pozwala na\nelastyczność w tworzeniu różnorodnych projektów, zarówno tych gęstszych, jak i\nbardziej luźnych.</p><p><b>Producen</b>t: GAZZAL</p><p><b>Skład</b>: 60% Bawełna, 40% Poliakryl</p><p><b>Motek</b>: 50 gram – 165 metrów</p><p><b>Zalecane druty</b>: 3,5 mm</p><p><b>Zalecane szydełka</b>: 2 mm do 4 mm </p><br />','','wloczka-baby-cotton-3411-jasny-roz','','','','Włóczka Baby Cotton 3411 jasny róż','','','',''),
(226,1,1,'<p></p><p>\n\n</p><p><b></b></p><p>\n\n</p><p><b>Włóczka Jeans PLUS</b> to\nwyjątkowy produkt, który zapewni Ci nie tylko doskonałe rezultaty w dzierganiu,\nale także niezrównaną przyjemność podczas tworzenia własnych projektów. Ta\nwłóczka jest znana z wysokiej jakości i wyjątkowych właściwości, które\nsprawiają, że jest doskonała do różnorodnych dzierganych projektów.</p><p>Każdy motek włóczki <b>Jeans PLUS</b>\nzawiera aż <b>100 gramów</b> materiału, co przekłada się na około <b>160 metrów\ndługości</b> włókien. Skład włóczki to <b>55% bawełny i 45%</b> <b>poliakrylu</b>,\nco daje idealną równowagę między naturalnymi a syntetycznymi włóknami. Dzięki\ntemu włóczka jest nie tylko miękka i delikatna w dotyku, ale także trwała i\nłatwa w pielęgnacji.</p><p><b>Rekomendowane druty i\nszydełko o rozmiarze 5 mm</b> pozwalają na wygodne i efektywne\ndzierganie, co sprawia, że praca z tą włóczką jest niezwykle przyjemna.</p><p><b>Włóczka Jeans PLUS</b>\njest szczególnie polecana do tworzenia kocyków i maskotek, ale jej\nuniwersalność sprawia, że można ją wykorzystać do wielu innych projektów. Bez\nwzględu na porę roku, ta włóczka sprawdzi się doskonale, ponieważ jest\nodpowiednia zarówno na chłodniejsze dni, jak i ciepłe letnie wieczory.</p><p>Jeśli szukasz włóczki, która pozwoli Ci\nwykonać wysokiej jakości, trwałe i jednocześnie delikatne projekty, to Włóczka\nJeans PLUS to doskonały wybór. </p><p></p><p><b>Motek</b>: 100 gram - 160 mb</p><p><b>Skład</b>: 55% bawełna, 45% poliakryl</p><p><b>Zalecane druty i szydełko</b>: 5\nmm </p><br />','','wloczka-jeans-plus-kolor-jasny-bez-05','','','','Włóczka Jeans Plus kolor jasny beż 05','','','',''),
(227,1,1,'<p></p><p>Włóczka IDEAL Yarn Art w to doskonały wybór dla miłośników rękodzieła, pragnących stworzyć wyjątkowe letnie projekty. Ta przyjemna i miła w dotyku włóczka cechuje się lekko matową strukturą, zapewniającą nie tylko estetyczny wygląd, ale także wyjątkowy komfort podczas tworzenia.</p><p><b>Najważniejsze Cechy:</b></p><p>·<b>Przyjemność w Dotyku:</b> Włóczka IDEAL Yarn Art gwarantuje niezwykłą miękkość, dzięki czemu praca z nią staje się czystą przyjemnością. Tworząc projekty, możesz cieszyć się komfortem każdego ruchu ręki.</p><p>·<b>Lekko Matowa Nitka:</b> Subtelnie matowa struktura włóczki nadaje projektom wyjątkowy wygląd, dodając im delikatnego uroku i elegancji. Idealna propozycja dla tych, którzy cenią sobie subtelność w detalu.</p><p>·<b>Idealna na Lato:</b> Włóczka IDEAL jest stworzona z myślą o letnich projektach. Jej lekkość sprawia, że idealnie nadaje się na wyroby noszone w cieplejszych miesiącach, zapewniając jednocześnie doskonałą wentylację.</p><p>·<strong>Skład 100% Bawełny:</strong> Wysoka jakość, jaką oferuje ta włóczka, wynika z jej składu – 100% bawełny. Naturalny materiał sprawia, że projekty są przyjazne dla skóry i doskonale sprawdzają się w codziennym użytkowaniu.</p><p>·<strong>Praktyczna Ilość:</strong> Każdy motek zawiera 50 gramów włóczki, co przekłada się na długość 170 metrów. Dzięki temu masz wystarczającą ilość na różne projekty i eksperymenty z kolorami. Możliwość łączenia różnych odcieni otwiera przed Tobą szerokie pole do tworzenia unikalnych wzorów i kompozycji.</p><p>·<strong>Zalecane Druty i Szydełko 3 mm:</strong> Optymalne narzędzia to klucz do uzyskania doskonałych rezultatów. Zalecamy korzystanie z drutów o rozmiarze 3 mm oraz szydełka o tym samym rozmiarze, co ułatwi pracę i zagwarantuje precyzyjne wykonanie.</p><p>Producent: YarnArt</p><p>Skład: 100 % bawełna</p><p>1 motek: 50 g -170 m</p><p>zalecane druty i szydełko: 3 mm </p><p></p>','','wloczka-ideal-kol-222-ecru','','','','Włóczka Ideal kol 222 ecru','','','',''),
