(326,1,1,'<p>Włóczka \"<strong>Exclusive</strong>\" od Gazzal to wyjątkowo luksusowy produkt, idealny dla wymagających miłośników rękodzieła. Składa się z <strong>30% jedwabiu malbery</strong> (Mulberry Silk), zapewniającego niezwykłą gładkość i połysk, <strong>10% ultradelikatnego moheru superkid</strong>, który dodaje włóczce puszystości i lekkości, oraz <strong>60% wełny merino superwash fine</strong>, która jest niezwykle miękka i odporna na filcowanie. Włóczka jest dostępna w motkach po <strong>25 gramów</strong>, z imponującą długością <strong>200 metrów</strong>. To doskonały wybór na wyjątkowe projekty takie jak delikatne szale, eleganckie chusty czy drobne swetry, które z pewnością zwrócą uwagę swoim wyrafinowanym wyglądem i doskonałą jakością.</p><p>Skład: 30% jedwab malbery, 10% superkid moher, 60% wełna merino superwash</p><p>1 motek: 25 gram - 200 metrów</p><p>Zalecane druty: 3 mm</p><p>Zalecane szdełko: 1,5 mm - 2 mm </p><p><strong>Jedwab Malbery</strong>, znany także jako jedwab morwowy, jest naturalnym włóknem wytwarzanym przez larwy motyli morwowych, zwłaszcza Bombyx mori, które żywią się wyłącznie liśćmi morwy. Jest to jeden z najbardziej luksusowych i cenionych materiałów używanych w produkcji tekstyliów ze względu na swoją miękkość, połysk i trwałość.</p><p class=\"MsoNormal\"></p><p></p><p><img src=\"https://www.twojapasmanteria.pl/img/cms/a/ikony.jpg\" alt=\"ikony\" width=\"263\" height=\"51\" /></p>','','wloczka-exclusive-gazzal-kolor-9902-ciemny-morski','','','','Włóczka Exclusive Gazzal kolor 9902 ciemny morski','','','',''),
