(546,1,1,'<p></p><p><b>100% bawełna merceryzowana:</b> Wykonany z najwyższej jakości bawełny merceryzowanej, kordonek cechuje się błyszczącą powierzchnią, dzięki procesowi merceryzacji. To nadaje mu delikatności, wytrzymałości i elegancji.</p><p></p><p><strong>Trwałość i odporność:</strong> Proces merceryzacji sprawia, że kordonek jest bardziej trwały, a kolory są bardziej wyraziste. Dodatkowo, jest odporny na ścieranie oraz kurczenie, co gwarantuje długotrwałe efekty Twoich projektów.</p><p><strong>Przyjazny dla skóry:</strong> Składający się z 100% bawełny, kordonek jest naturalny i przyjazny dla skóry, co sprawia, że nadaje się do tworzenia projektów noszonych bez obaw o alergie czy podrażnienia.</p><p><strong>Wydajność:</strong> Jedna kulka to 50 gramów kordonka, co stanowi ilość 282 metrów. To sprawia, że jest ekonomicznym wyborem.</p><p><strong>Uniwersalność zastosowania:</strong> Nadaje się do różnorodnych technik rękodzielniczych, takich jak szydełkowanie, wyplatanie czy haftowanie, co sprawia, że jest wszechstronny i dostosowany do różnorodnych projektów.</p><p><strong>Zalecane narzędzia:</strong> Dla optymalnych rezultatów, zalecane są szydełko o rozmiarze 2,5 mm oraz druty o tym samym rozmiarze, co ułatwia pracę i gwarantuje precyzyjne wykonanie.</p><p>Producent: YarnArt</p><p>Skład: 100% bawełna </p><p>1 motek: 50 gram / 282 m</p><p>Zalecane szydełko: 2,5 mm</p><p>Zalecane druty: 2,5 mm</p><p></p><p></p>','','kordonek-violet-yarnart-0008-turkus','','','','Kordonek Violet YarnArt 0008 turkus','','','',''),
