(611,1,1,'<p></p><p>Metaliczny kordonek <b>SPARKLE</b> od renomowanego producenta <b>YarnArt</b> to wyjątkowa, elegancka przędza, idealna do projektów wymagających subtelnego blasku i luksusowego wykończenia. Składa się w 60% z metalicznej, poliestrowej nitki, która nadaje przędzy delikatny połysk, oraz w 40% z poliamidu, co zapewnia miękkość i trwałość. </p><p>Nitka ma płaską strukturę o szerokości około 2 mm, co sprawia, że jest doskonała do szydełkowania i robienia na drutach ozdobnych elementów, dodatków oraz biżuterii. Jeden motek waży 25 gramów i mieści 160 metrów przędzy, co pozwala na realizację wielu kreatywnych projektów.</p><p>1 kulka 25 gram 160 metrów</p><p>Zalecane druty: 2,5 mm</p><p>Zalecane szydełko: 3 mm </p><p>Dzięki swojej metalicznej estetyce, Sparkle świetnie nadaje się do tworzenia unikalnych, błyszczących projektów, które zachwycą nie tylko wyglądem, ale i jakością wykonania.</p><br />','','kordonek-metaliczny-sparkle-srebrny-1300','','','','Kordonek metaliczny Sparkle srebrny 1300','','','',''),
