(654,1,1,'<p class=\"MsoNormal\"><span style=\"font-family:Arial, sans-serif;\">Druty na żyłce 40 cm to doskonały wybór dla pasjonatów dziergania, niezależnie od ich poziomu zaawansowania. Produkt ten, oferowany przez renomowaną firmę Pony, jest jednym z najbardziej popularnych drutów teflonowych dostępnych na rynku. Charakteryzują się one nie tylko wysoką jakością wykonania, ale również atrakcyjnymi cenami, co sprawia, że są one idealne zarówno dla doświadczonych rzemieślników, jak i osób dopiero rozpoczynających swoją przygodę z dzierganiem, włączając w to również dzieci.</span></p><p>Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</p><p>Kuleczka występuje tylko w rozmiarach od 3 mm <span> </span>wzwyż.</p><p>Druty na żyłce 40 cm są popularne wśród osób zajmujących się dzierganiem zarówno zawodowo, jak i amatorsko. Ich długość jest wystarczająca do wykonywania wielu różnych projektów, a zarazem są wystarczająco krótkie, aby być wygodnymi w użytkowaniu, zwłaszcza <span> </span>dla osób dziergających mniejsze elementy, takie jak rękawki, opaski, maskotki.</p><p><b><span style=\"font-family:Arial, sans-serif;\">Producent</span></b><span style=\"font-family:Arial, sans-serif;\">: PONY</span></p><p><span style=\"font-family:Arial, sans-serif;\"><strong>Materiał</strong>: TEFLON<br /></span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Rozmiar</span></b><span style=\"font-family:Arial, sans-serif;\">: 2,5 mm</span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Długość</span></b><span style=\"font-family:Arial, sans-serif;\">: 40 cm (długość wraz z żyłką)</span></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p><p class=\"MsoNormal\"></p><p> </p><p class=\"MsoNormal\"></p><p> </p>','','druty-pony-na-zylce-40-cm-25-mm','','','','Druty PONY na żyłce 40 cm - 2,5 mm','','','',''),
(655,1,1,'<p class=\"MsoNormal\">Druty teflonowe na żyłce Pony o długości 100 cm to niezawodne narzędzia dla pasjonatów rękodzieła i hobbystów, poszukujących wysokiej jakości materiałów do swoich projektów. Wykorzystując innowacyjną technologię teflonu, te druty zapewniają doskonałą wytrzymałość i gładkość podczas pracy z różnorodnymi rodzajami włókien.</p><p></p><p><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\">Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</span></p><p>Kuleczka występuje tylko w rozmiarach od 3 mm wzwyż.</p><p><b><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Producent</span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: PONY</span></span></p><p><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p><strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Materiał</span></strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: TEFLON</span></p><p style=\"word-spacing:0px;\"><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Rozmiar</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 2,5<span> </span>mm</span></span></p><p><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Długość</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 100 cm (długość wraz z żyłką)</span></span></p><p style=\"word-spacing:0px;\"><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p>','','druty-pony-na-zylce-100-cm-25-mm','','','','Druty PONY na żyłce 100 cm - 2,5 mm','','','',''),
