(716,1,1,'<p>Druty stalowe na lince + igła do szycia włóczką ze złotym uchem to doskonałe narzędzie dla pasjonatów rękodzieła. Wyjątkowo lekkie, gładkie i przyjemne w użytkowaniu. Ich długość wynosi 13 cm, a razem z linką osiągają 80 cm, zapewniając wygodę i elastyczność w pracy. Idealne do różnorodnych projektów, te druty z igłą są niezastąpione w tworzeniu wyjątkowych dzieł rękodzielniczych.</p><p>Do każdej pary drutów dołączona jest igła dziewiarska, która służy do szycia materiałów takich jak wełna lub filc. <span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Jej grubszy trzonek i szerokie ucho ułatwiają przewlekaniu przez nią grubych nici czy włókien, co sprawia, że jest idealna do pracy z grubymi włóknami, które standardowa igła do szycia mogłaby z trudem przechodzić. Jest powszechnie używana do naprawy, dekoracji oraz wykończenia takich przedmiotów jak koce, poduszki, dywany, a także w pracach haftu czy szydełkowania, gdzie potrzebne jest połączenie grubego włókna z innymi materiałami.</span></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"><span style=\"font-family:\'Times New Roman\', serif;\"></span></p><p><b>Materiał</b>: stal</p><p><b>Rozmiar</b>: 5 mm</p><p><b>Długość</b>: 80 cm (długość wraz z linką) </p><p> </p>','','druty-stalowe-na-lince-80-cm-5-mm-igla','','','','Druty stalowe na lince 80 cm - 5 mm + igła','','','',''),
(717,1,1,'<p class=\"MsoNormal\"><span style=\"font-family:Arial, sans-serif;\">Druty na żyłce 40 cm to doskonały wybór dla pasjonatów dziergania, niezależnie od ich poziomu zaawansowania. Produkt ten, oferowany przez renomowaną firmę Pony, jest jednym z najbardziej popularnych drutów teflonowych dostępnych na rynku. Charakteryzują się one nie tylko wysoką jakością wykonania, ale również atrakcyjnymi cenami, co sprawia, że są one idealne zarówno dla doświadczonych rzemieślników, jak i osób dopiero rozpoczynających swoją przygodę z dzierganiem, włączając w to również dzieci.</span></p><p>Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</p><p>Kuleczka występuje tylko w rozmiarach od 3 mm <span> </span>wzwyż.</p><p>Druty na żyłce 40 cm są popularne wśród osób zajmujących się dzierganiem zarówno zawodowo, jak i amatorsko. Ich długość jest wystarczająca do wykonywania wielu różnych projektów, a zarazem są wystarczająco krótkie, aby być wygodnymi w użytkowaniu, zwłaszcza <span> </span>dla osób dziergających mniejsze elementy, takie jak rękawki, opaski, maskotki.</p><p><b><span style=\"font-family:Arial, sans-serif;\">Producent</span></b><span style=\"font-family:Arial, sans-serif;\">: PONY</span></p><p><span style=\"font-family:Arial, sans-serif;\"><strong>Materiał</strong>: TEFLON</span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Rozmiar</span></b><span style=\"font-family:Arial, sans-serif;\">: 6 mm</span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Długość</span></b><span style=\"font-family:Arial, sans-serif;\">: 40 cm (długość wraz z żyłką)</span></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p><p class=\"MsoNormal\"></p><p> </p><p class=\"MsoNormal\"></p><p> </p>','','druty-pony-na-zylce-40-cm-6-mm','','','','Druty PONY na żyłce 40 cm - 6 mm','','','',''),
(718,1,1,'<p class=\"MsoNormal\">Druty teflonowe na żyłce Pony o długości 100 cm to niezawodne narzędzia dla pasjonatów rękodzieła i hobbystów, poszukujących wysokiej jakości materiałów do swoich projektów. Wykorzystując innowacyjną technologię teflonu, te druty zapewniają doskonałą wytrzymałość i gładkość podczas pracy z różnorodnymi rodzajami włókien.</p><p></p><p><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\">Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</span></p><p>Kuleczka występuje tylko w rozmiarach od 3 mm wzwyż.</p><p><b><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Producent</span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: PONY</span></span></p><p><strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Materiał</span></strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: TEFLON</span></p><p style=\"word-spacing:0px;\"><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Rozmiar</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 6 mm</span></span></p><p><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Długość</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 100 cm (długość wraz z żyłką)</span></span></p><p style=\"word-spacing:0px;\"></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p>','','druty-pony-na-zylce-100-cm-6-mm','','','','Druty PONY na żyłce 100 cm - 6 mm','','','',''),
