(784,1,1,'<div style=\"border:solid #D9D9E3 1pt;padding:0cm 0cm 0cm 0cm;\">\n<p style=\"border:none;padding:0cm;margin:0cm 0cm 15pt 0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">Zestaw aluminiowych szydełek w etui z igłą dziewiarską i znacznikami to idealny komplet dla każdego miłośnika dziergania. Ten zestaw zapewni Ci wszystko, czego potrzebujesz do tworzenia projektów z włóczki.</span></p><p></p>\n<p style=\"margin:15pt 0cm;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">W skład zestawu wchodzą:</span></p><p></p>\n</div><div style=\"border:solid #D9D9E3 1pt;padding:0cm 0cm 0cm 5pt;margin-left:18pt;margin-right:0cm;\">\n<p style=\"text-indent:-18pt;border:none;padding:0cm;margin:0cm 0cm 0cm 18pt;\"><!-- [if !supportLists]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">1.<span style=\"font-size:7pt;line-height:normal;font-family:\'Times New Roman\';\">     </span></span><!--[endif]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">Aluminiowe szydełka o długości 14,5 cm w różnych kolorach, co ułatwia rozróżnienie rozmiarów. Obejmuje to rozmiary 2/2,5/3/3,5/4/4,5/5/5,5/6/7/8</span></p><p></p>\n<p style=\"text-indent:-18pt;border:none;padding:0cm;margin:0cm 0cm 0cm 18pt;\"><!-- [if !supportLists]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">2.<span style=\"font-size:7pt;line-height:normal;font-family:\'Times New Roman\';\">     </span></span><!--[endif]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">Znaczniki/agrafki dziewiarskie - zestaw zawiera 20 sztuk znaczników, które są niezbędne do oznaczania ważnych punktów w trakcie dziergania. Pomogą Ci śledzić wzory i uniknąć pomyłek.</span></p><p></p>\n<p style=\"text-indent:-18pt;border:none;padding:0cm;margin:0cm 0cm 0cm 18pt;\"><!-- [if !supportLists]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">3.<span style=\"font-size:7pt;line-height:normal;font-family:\'Times New Roman\';\">     </span></span><!--[endif]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">Plastikowa igła do szycia włóczka - gdy konieczne jest zszywanie lub ukrywanie końców włóczki. Jest trwała i wygodna w użyciu.</span></p><p></p>\n<p style=\"text-indent:-18pt;border:none;padding:0cm;margin:0cm 0cm 0cm 18pt;\"><!-- [if !supportLists]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">4.<span style=\"font-size:7pt;line-height:normal;font-family:\'Times New Roman\';\">     </span></span><!--[endif]--><span style=\"font-family:\'Segoe UI\', sans-serif;color:#374151;\">Etui - cały zestaw jest przechowywany w praktycznym etui, które zapewnia porządek i chroni narzędzia przed uszkodzeniami i zgubieniem. </span></p><p></p>\n</div><p></p><p class=\"MsoNormal\"></p><p> </p><p><span style=\"font-size:12px;line-height:normal;\"> </span></p><p></p><div class=\"list_products\" style=\"font-family:Arial, Helvetica, sans-serif;font-size:12px;font-style:normal;line-height:normal;\"> </div>','','zestaw-szydelek-z-igla-i-znacznikami','','','','Zestaw szydełek z igłą i znacznikami','','','',''),
