(829,1,1,'<div style=\"border:1pt solid #d9d9e3;padding:0cm;\">\n<p class=\"MsoNormal\" style=\"margin:0cm 0cm 15pt;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0f0f0f;\"><strong>Komplet igieł do wełny marki PONY</strong>, który stanowi niezastąpione narzędzie dla każdego miłośnika dziergania i robótek ręcznych. Ten zestaw igieł spełni oczekiwania nawet najbardziej wymagających hobbystów.</span></p>\n<p></p>\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0f0f0f;\">Igiełki wchodzące w skład tego kompletu są wykonane z lekkiego teflonu, co sprawia, że są niezwykle wytrzymałe i trwałe. Teflonowa powierzchnia gwarantuje, że igiełki będą się gładko przesuwać przez włókna wełniane, co ułatwia proces dziergania oraz zminimalizuje ryzyko zaciągnięcia lub uszkodzenia włókien.</span></p>\n<p></p>\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0f0f0f;\">Każda igiełka jest zakończona oczkiem wykonanym z elastycznej żyłki silikonowej, co dodaje im dodatkowej funkcjonalności. Dzięki temu oczku, można łatwo nawlec włókna na igiełkę, co jest szczególnie przydatne przy różnorodnych projektach.</span></p>\n<p></p>\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0f0f0f;\"><strong>Ten zestaw igieł do wełny PONY</strong> <strong>zawiera 3 sztuki</strong> o różnych rozmiarach, aby sprostać różnym potrzebom i projektom. <strong>Długości igiełek bez oczka wynoszą odpowiednio: 6 cm, 7 cm i 8,5 cm</strong></span></p>\n<p></p>\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0f0f0f;\"> </span></p>\n</div>','','igly-do-welny-pony-3-sztuki-rozne-rozmiary','','','','Igły do wełny PONY 3 sztuki różne rozmiary','','','',''),
(830,1,1,'<p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"><span style=\"font-family:Arial, sans-serif;color:#374151;\">Ten kompaktowy zestaw <b>igieł plastikowych do szycia włóczką </b>jest niezastąpionym narzędziem dla każdego miłośnika dziergania i robótek ręcznych. <b>Zawiera dwie igły, o długościach odpowiednio 7 cm i 9 cm</b>, idealnie dopasowane do różnorodnych projektów dzianinowych, od drobnych poprawek po łączenie większych elementów dzianiny. Wykonane plastiku, te igły są lekkie, ale wytrzymałe, co zapewnia komfort użytkowania nawet podczas długich godzin pracy nad projektami. Ich gładka powierzchnia ułatwia przesuwanie się przez najróżniejsze rodzaje włóczek bez uszkadzania materiału lub zaplątywania nici. </span><span style=\"font-size:14pt;font-family:Arial, sans-serif;\"></span></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"><span style=\"font-family:Arial, sans-serif;color:#374151;\"></span></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"><span style=\"font-family:Arial, sans-serif;color:#374151;\">Uwaga: Kolory wysyłane losowo (każdy rozmiar w innym kolorze) </span></p><p></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"></p><p> </p><p></p>','','igly-plastikowe-2-sztuki','','','','Igły plastikowe 2 sztuki','','','',''),
