(835,1,1,'<div style=\"border:1pt solid #d9d9e3;padding:0cm;\">\n<p class=\"MsoNormal\" style=\"margin:0cm 0cm 15pt;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Times New Roman\', serif;\">Ten <b>zestaw zakrzywionych igieł do szycia włóczką</b> to niezbędny element wyposażenia każdego miłośnika robótek ręcznych i dziergania. <b>Zestaw składa się z dwóch igieł</b> w tym samym rozmiarze, które zostały starannie wykonane ze stali zabezpieczonej przed korozją, zapewniając ich trwałość i odporność na uszkodzenia przez długi czas użytkowania. Zakrzywiona forma igieł jest specjalnie zaprojektowana, aby ułatwić przeszywanie i łączenie grubych, włóczkowych materiałów, co jest często wyzwaniem przy użyciu tradycyjnych, prostych igieł.</span></p><p></p>\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Times New Roman\', serif;\">Dzięki swojej unikalnej konstrukcji, te igły są idealne do precyzyjnych prac, takich jak szycie na okrągło czy dokonywanie trudnych dojść, gdzie precyzja i kontrola nad igłą są kluczowe. Zakrzywienie igły pozwala na łatwiejsze manipulowanie nią w trudno dostępnych miejscach, co znacząco ułatwia proces szycia i łączenia elementów dzianiny.</span></p><p></p>\n</div><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"><span style=\"font-family:\'Times New Roman\', serif;\">Uwaga: kolory wysyłane losowo (każda igła w innym kolorze)</span></p><p></p><p></p>','','metalowe-igly-zakrzywione-do-wloczki','','','','Metalowe igły zakrzywione do włóczki','','','',''),
(836,1,1,'<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\">Zestaw zawiera :</span></p><p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\">Regulacja długości igły od 1 do 12 mm</span></p><p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\">dwa długie nawlekacze </span></p><p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\">3 igły tkackie z nasadkami w różnych rozmiarach<span>  </span></span></p><p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\"></span></p><p> </p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\"></span></p><p> </p>Punch Needle to nowoczesna i łatwa technika haftowania,.<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\">Wystarczy, że opanujesz kilka prostych ruchów, a będziesz w stanie wyczarować poduszkę, organizer na ścianę, osłonki na doniczki, dywaniki, niepowtarzalne torebki, których nie znajdziesz w żadnym sklepie, i wiele innych efektownych dekoracji do swojego domu.</span></p><p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Arial, sans-serif;color:#333333;\"></span></p><p> </p><p>INSTRUKCJĘ DO IGŁY MOŻNA POBR