(871,1,1,'<p>Druty aluminiowe pokryte teflonem</p><p>Długość 14 cm </p><p>Druty pasują do żyłek 40 cm,  60 cm, 80 cm, 100 cm, 120 cm </p><p>Podane wymiary żyłek to długość żyłki z drutem </p><p></p><p>Przejście między żyłką a drutami jest bardzo łagodne, dzięki czemu oczka przechodzą przez nie bez problemu</p><p>Zmiana żyłek jest bardzo łatwa i szybka </p><p></p>','','druty-pony-do-laczenia-z-zylka-3-mm','','','','Druty PONY do łączenia z żyłką 3 mm','','','',''),
