(873,1,1,'<div style=\"border:solid #E3E3E3 1pt;padding:0cm 0cm 0cm 0cm;background:#FFFFFF;\">\n<p style=\"background:#FFFFFF;border:none;padding:0cm;margin:0cm 0cm 15pt 0cm;\"><b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Druty Pony na żyłce o długości 28 cm</span></b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\"> służą do robienia na drutach, szczególnie przydatne są przy dzierganiu mniejszych, okrągłych projektów takich jak skarpety, rękawiczki, czapki, rękawy czy elementy zabawek. Pozwalają na łatwe dzierganie w okręgu, eliminując potrzebę stosowania wielu drutów jednocześnie, co jest typowe dla techniki dziergania na czterech lub pięciu drutach.</span></p>\n<p>Żyłka łącząca druty umożliwia dzierganie ciągłe bez szwu, co jest idealne dla projektów, które wymagają gładkiej, jednolitej struktury. Długość 28 cm jest szczególnie dobrze dopasowana do mniejszych projektów, gdzie nie potrzeba dużo miejsca do pracy, a mniejsza długość drutów i żyłki ułatwia utrzymanie odpowiedniej napiętości dzianiny. <b>Druty Pony</b> są popularną marką wśród miłośników rękodzieła, cenioną za jakość i wygodę użytkowania.</p>\n<p><span style=\"font-family:\'Open Sans\', sans-serif;color:#000000;background:#FFFFFF;\">Zestaw składa się z </span><b style=\"word-spacing:0px;\">dwóch różnej długości (4,5 cm i 7 cm) drutów</b><span style=\"float:none;word-spacing:0px;\"> połączonych żyłką.</span></p>\n</div><p class=\"MsoNormal\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</span><span style=\"font-family:\'Open Sans\', sans-serif;\"></span></p><p></p><p><b>Rozmiar</b>: 2,5 mm</p><p><b>Marka</b>: PONY</p><p><b>Materiał</b>: plastik</p><p><b>Długość drutów</b>: 4,5 cm i 7 cm</p><p><b>Długość żyłki</b>: 15 cm</p><p><b>Długość całkowita</b>: 28 cm</p><p></p><p class=\"MsoListParagraphCxSpLast\"></p><p> </p>','','druty-do-skarpet-pony-na-zylce-28-cm-25-mm','','','','Druty do skarpet PONY na żyłce 28 cm/2,5 mm','','','',''),
(874,1,1,'<p class=\"MsoNormal\"><span style=\"font-family:Arial, sans-serif;\">Druty na żyłce 40 cm to doskonały wybór dla pasjonatów dziergania, niezależnie od ich poziomu zaawansowania. Produkt ten, oferowany przez renomowaną firmę Pony, jest jednym z najbardziej popularnych drutów teflonowych dostępnych na rynku. Charakteryzują się one nie tylko wysoką jakością wykonania, ale również atrakcyjnymi cenami, co sprawia, że są one idealne zarówno dla doświadczonych rzemieślników, jak i osób dopiero rozpoczynających swoją przygodę z dzierganiem, włączając w to również dzieci.</span></p><p>Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</p><p>Kuleczka występuje tylko w rozmiarach od 3 mm <span> </span>wzwyż.</p><p>Druty na żyłce 40 cm są popularne wśród osób zajmujących się dzierganiem zarówno zawodowo, jak i amatorsko. Ich długość jest wystarczająca do wykonywania wielu różnych projektów, a zarazem są wystarczająco krótkie, aby być wygodnymi w użytkowaniu, zwłaszcza <span> </span>dla osób dziergających mniejsze elementy, takie jak rękawki, opaski, maskotki.</p><p><b><span style=\"font-family:Arial, sans-serif;\">Producent</span></b><span style=\"font-family:Arial, sans-serif;\">: PONY</span></p><p><span style=\"font-family:Arial, sans-serif;\"><strong>Materiał</strong>: TEFLON</span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Rozmiar</span></b><span style=\"font-family:Arial, sans-serif;\">: 2 mm</span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Długość</span></b><span style=\"font-family:Arial, sans-serif;\">: 40 cm (długość wraz z żyłką)</span></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p><p class=\"MsoNormal\"></p><p> </p><p class=\"MsoNormal\"></p><p> </p>','','druty-pony-na-zylce-40-cm-2-mm','','','','Druty PONY na żyłce 40 cm - 2 mm','','','',''),
(875,1,1,'<p class=\"MsoNormal\">Druty teflonowe na żyłce Pony o długości 100 cm to niezawodne narzędzia dla pasjonatów rękodzieła i hobbystów, poszukujących wysokiej jakości materiałów do swoich projektów. Wykorzystując innowacyjną technologię teflonu, te druty zapewniają doskonałą wytrzymałość i gładkość podczas pracy z różnorodnymi rodzajami włókien.</p><p></p><p><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\">Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</span></p><p>Kuleczka występuje tylko w rozmiarach od 3 mm wzwyż.</p><p><b><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Producent</span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: PONY</span></span></p><p><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p><strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Materiał</span></strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: TEFLON</span></p><p style=\"word-spacing:0px;\"><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Rozmiar</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 2<span> </span>mm</span></span></p><p><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Długość</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 100 cm (długość wraz z żyłką)</span></span></p><p style=\"word-spacing:0px;\"><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p>','','druty-pony-na-zylce-100-cm-2-mm','','','','Druty PONY na żyłce 100 cm - 2 mm','','','',''),
(876,1,1,'<p>Wysokiej jakości szydełko do pracy z włóczką</p><p>Szydełko teflonowe z plastikową rączką o całkowitej długości 14 cm</p><p>Średnica: 2,5 mm</p>','','szydelko-teflonowe-pony-z-raczka-25-mm','','','','Szydełko teflonowe PONY z rączką 2,5 mm','','','',''),
(877,1,1,'<div style=\"color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;border:1pt solid rgb(227,227,227);padding:0cm;\">\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><b><span style=\"font-family:Arial, sans-serif;\">Szydełko Easy Grip Pony</span></b><span style=\"font-family:Arial, sans-serif;\"> to doskonałe narzędzie dla pasjonatów szydełkowania, zapewniające wygodę i precyzję podczas tworzenia najróżniejszych projektów. Dzięki swojemu ergonomicznemu kształtowi i specjalnemu uchwytowi, zapewnia komfortowe trzymanie i redukuje zmęczenie dłoni nawet podczas długotrwałego użytkowania.</span></p><p></p>\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><b><span style=\"font-family:Arial, sans-serif;border:1pt solid rgb(227,227,227);padding:0cm;\">Najważniejsze cechy:</span></b><span style=\"font-family:Arial, sans-serif;\"></span></p><p></p>\n</div><div style=\"color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;border:1pt solid rgb(227,227,227);padding:0cm 0cm 0cm 5pt;margin-left:18pt;margin-right:0cm;\">\n<ul type=\"disc\" style=\"margin-bottom:0cm;margin-top:0cm;\">\n<li class=\"MsoNormal\" style=\"margin-left:18pt;border:none;padding:0cm;\"><b><span style=\"font-family:Arial, sans-serif;border:1pt solid rgb(227,227,227);padding:0cm;\">Ergonomiczny Design:</span></b><span style=\"font-family:Arial, sans-serif;\"> Szydełko zostało zaprojektowane z myślą o wygodzie użytkownika. Jego ergonomiczny kształt i specjalny uchwyt zapewniają komfortowe trzymanie, co sprawia, że szydełkowanie staje się jeszcze bardziej przyjemne.</span><p></p></li>\n<li class=\"MsoNormal\" style=\"margin-left:18pt;border:none;padding:0cm;\"><b><span style=\"font-family:Arial, sans-serif;border:1pt solid rgb(227,227,227);padding:0cm;\">Precyzyjne Wykończenie:</span></b><span style=\"font-family:Arial, sans-serif;\"> Dzięki wysokiej jakości wykonania, szydełko gwarantuje precyzyjne i płynne szydełkowanie, bez ryzyka przerywania włókien czy zacinek.</span><p></p></li>\n<li class=\"MsoNormal\" style=\"margin-left:18pt;border:none;padding:0cm;\"><b><span style=\"font-family:Arial, sans-serif;border:1pt solid rgb(227,227,227);padding:0cm;\">Uniwersalne Zastosowanie:</span></b><span style=\"font-family:Arial, sans-serif;\"> Szydełko Easy Grip Pony jest idealne do różnorodnych projektów szydełkowych, od delikatnych haftów po grubsze wzory, nadając się zarówno dla początkujących, jak i zaawansowanych użytkowników.</span><p></p></li>\n<li class=\"MsoNormal\" style=\"margin-left:18pt;border:none;padding:0cm;\"><b><span style=\"font-family:Arial, sans-serif;border:1pt solid rgb(227,227,227);padding:0cm;\">Solidna Konstrukcja:</span></b><span style=\"font-family:Arial, sans-serif;\"> Wykonane z wytrzymałego materiału, szydełko jest solidne i trwałe, co sprawia, że można z nim pracować przez wiele lat bez obaw o jego stan.</span><p></p></li>\n</ul>\n</div><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;\"><span style=\"font-family:Arial, sans-serif;\"></span></p><p> </p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;\"><span style=\"font-family:Arial, sans-serif;color:#000000;background-color:#FFFFFF;\">Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</span><span style=\"font-family:Arial, sans-serif;\"></span></p><p></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;\"><span style=\"font-family:Arial, sans-serif;\"></span></p><p> </p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;\"><b><span style=\"font-family:Arial, sans-serif;\">Marka</span></b><span style=\"font-family:Arial, sans-serif;\">: PONY</span></p><p></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;\"><b><span style=\"font-family:Arial, sans-serif;\">Materiał</span></b><span style=\"font-family:Arial, sans-serif;\">: teflon + ergonomiczna rączka</span></p><p></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;color:rgb(0,0,0);font-style:normal;font-weight:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;\"><b><span style=\"font-family:Arial, sans-serif;\">Długość</span></b><span style=\"font-family:Arial, sans-serif;\">: 14 cm<br /></span><b><span style=\"font-family:Arial, sans-serif;\">Rozmiar</span></b><span style=\"font-family:Arial, sans-serif;\">: 2 mm</span></p>','','szydelko-easy-grip-pony-rozmiar-2-mm','','','','Szydełko EASY GRIP PONY rozmiar 2 mm','','','',''),
