(879,1,1,'<p>Żyłka z serii PONY Perfect </p><p>Pasuje do szydełek i drutów z tej samej serii</p><p>Przejścia między drutami a żyłka są bardzo łagodne, dzięki czemu oczka łatwo przechodzą</p><p>Wymiana żyłki jest bardzo łatwa i szybka </p><p>W długość żyłki wliczona jest długość drutów </p><p></p>','','zylka-pony-do-laczenia-80-cm','','','','Żyłka PONY do łączenia 80 cm','','','',''),
(880,1,1,'<p>Druty aluminiowe pokryte teflonem</p><p>Długość 14 cm </p><p>Druty pasują do żyłek 40 cm,  60 cm, 80 cm, 100 cm, 120 cm </p><p>Podane wymiary żyłek to długość żyłki z drutem </p><p></p><p>Przejście między żyłką a drutami jest bardzo łagodne, dzięki czemu oczka przechodzą przez nie bez problemu</p><p>Zmiana żyłek jest bardzo łatwa i szybka </p><p></p>','','druty-pony-do-laczenia-z-zylka-325-mm','','','','Druty PONY do łączenia z żyłką 3,25 mm','','','',''),
(881,1,1,'<div style=\"border:solid #E3E3E3 1pt;padding:0cm 0cm 0cm 0cm;background:#FFFFFF;\">\n<p style=\"background:#FFFFFF;border:none;padding:0cm;margin:0cm 0cm 15pt 0cm;\"><b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Druty Pony na żyłce o długości 28 cm</span></b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\"> służą do robienia na drutach, szczególnie przydatne są przy dzierganiu mniejszych, okrągłych projektów takich jak skarpety, rękawiczki, czapki, rękawy czy elementy zabawek. Pozwalają na łatwe dzierganie w okręgu, eliminując potrzebę stosowania wielu drutów jednocześnie, co jest typowe dla techniki dziergania na czterech lub pięciu drutach.</span></p>\n<p>Żyłka łącząca druty umożliwia dzierganie ciągłe bez szwu, co jest idealne dla projektów, które wymagają gładkiej, jednolitej struktury. Długość 28 cm jest szczególnie dobrze dopasowana do mniejszych projektów, gdzie nie potrzeba dużo miejsca do pracy, a mniejsza długość drutów i żyłki ułatwia utrzymanie odpowiedniej napiętości dzianiny. <b>Druty Pony</b> są popularną marką wśród miłośników rękodzieła, cenioną za jakość i wygodę użytkowania.</p>\n<p><span style=\"font-family:\'Open Sans\', sans-serif;color:#000000;background:#FFFFFF;\">Zestaw składa się z </span><b style=\"word-spacing:0px;\">dwóch różnej długości (4,5 cm i 7 cm) drutów</b><span style=\"float:none;word-spacing:0px;\"> połączonych żyłką.</span></p>\n</div><p class=\"MsoNormal\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</span><span style=\"font-family:\'Open Sans\', sans-serif;\"></span></p><p></p><p><b>Rozmiar</b>: 3 mm</p><p><b>Marka</b>: PONY</p><p><b>Materiał</b>: plastik</p><p><b>Długość drutów</b>: 4,5 cm i 7 cm</p><p><b>Długość żyłki</b>: 15 cm</p><p><b>Długość całkowita</b>: 28 cm</p><p></p><p class=\"MsoListParagraphCxSpLast\"></p><p> </p>','','druty-do-skarpet-pony-na-zylce-28-cm-3-mm','','','','Druty do skarpet PONY na żyłce 28 cm/3 mm','','','',''),
(882,1,1,'<p class=\"MsoNormal\"><span style=\"font-family:Arial, sans-serif;\">Druty na żyłce 40 cm to doskonały wybór dla pasjonatów dziergania, niezależnie od ich poziomu zaawansowania. Produkt ten, oferowany przez renomowaną firmę Pony, jest jednym z najbardziej popularnych drutów teflonowych dostępnych na rynku. Charakteryzują się one nie tylko wysoką jakością wykonania, ale również atrakcyjnymi cenami, co sprawia, że są one idealne zarówno dla doświadczonych rzemieślników, jak i osób dopiero rozpoczynających swoją przygodę z dzierganiem, włączając w to również dzieci.</span></p><p>Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</p><p>Kuleczka występuje tylko w rozmiarach od 3 mm <span> </span>wzwyż.</p><p>Druty na żyłce 40 cm są popularne wśród osób zajmujących się dzierganiem zarówno zawodowo, jak i amatorsko. Ich długość jest wystarczająca do wykonywania wielu różnych projektów, a zarazem są wystarczająco krótkie, aby być wygodnymi w użytkowaniu, zwłaszcza <span> </span>dla osób dziergających mniejsze elementy, takie jak rękawki, opaski, maskotki.</p><p><b><span style=\"font-family:Arial, sans-serif;\">Producent</span></b><span style=\"font-family:Arial, sans-serif;\">: PONY</span></p><p><span style=\"font-family:Arial, sans-serif;\"><strong>Materiał</strong>: TEFLON<br /></span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Rozmiar</span></b><span style=\"font-family:Arial, sans-serif;\">: 2,5 mm</span></p><p><b><span style=\"font-family:Arial, sans-serif;\">Długość</span></b><span style=\"font-family:Arial, sans-serif;\">: 40 cm (długość wraz z żyłką)</span></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p><p class=\"MsoNormal\"></p><p> </p><p class=\"MsoNormal\"></p><p> </p>','','druty-pony-na-zylce-40-cm-25-mm','','','','Druty PONY na żyłce 40 cm - 2,5 mm','','','',''),
(883,1,1,'<p class=\"MsoNormal\">Druty teflonowe na żyłce Pony o długości 100 cm to niezawodne narzędzia dla pasjonatów rękodzieła i hobbystów, poszukujących wysokiej jakości materiałów do swoich projektów. Wykorzystując innowacyjną technologię teflonu, te druty zapewniają doskonałą wytrzymałość i gładkość podczas pracy z różnorodnymi rodzajami włókien.</p><p></p><p><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\">Niezwykle wygodnym i cenionym elementem tych drutów jest charakterystyczna kuleczka łącząca druty z żyłką. Ten innowacyjny detal nie tylko ułatwia korzystanie z produktu, ale również zapewnia trwałość i płynność łączenia, co przekłada się na wygodę podczas pracy.</span></p><p>Kuleczka występuje tylko w rozmiarach od 3 mm wzwyż.</p><p><b><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Producent</span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: PONY</span></span></p><p><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p><strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Materiał</span></strong><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: TEFLON</span></p><p style=\"word-spacing:0px;\"><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Rozmiar</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 2,5<span> </span>mm</span></span></p><p><b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">Długość</span></span></b><span><span style=\"font-size:8.5pt;font-family:Arial, sans-serif;color:#000000;\">: 100 cm (długość wraz z żyłką)</span></span></p><p style=\"word-spacing:0px;\"><span style=\"font-size:8.5pt;font-family:Verdana, sans-serif;color:#000000;\"></span></p><p>Producent dokonał zmiany opakowania. Może się zdarzyć, że niektóre rozmiary produktów będą jeszcze dostępne w opakowaniach starego wzoru.</p><p></p>','','druty-pony-na-zylce-100-cm-25-mm','','','','Druty PONY na żyłce 100 cm - 2,5 mm','','','',''),
(884,1,1,'<p>Kolorowe druty proste dla dzieci</p><p>Dwa różne kolory drutów świetnie sprawdzają się podczas nauki.</p><p>Najmłodsi docenią wyjątkową lekkość </p><p>Długość 18 cm </p>','','druty-proste-dla-dzieci-5-mm','','','','Druty proste dla dzieci 5 mm','','','',''),
