(887,1,1,'<p>Żyłka z serii PONY Perfect </p><p>Pasuje do szydełek i drutów z tej samej serii</p><p>Przejścia między drutami a żyłka są bardzo łagodne, dzięki czemu oczka łatwo przechodzą</p><p>Wymiana żyłki jest bardzo łatwa i szybka </p><p>W długość żyłki wliczona jest długość drutów </p><p></p>','','zylka-pony-do-laczenia-100-cm','','','','Żyłka PONY do łączenia 100 cm','','','',''),
