(970,1,1,'<p class=\"MsoNormal\">Ergonomiczne druty na żyłce PRYM</p><p></p><p class=\"MsoNormal\">Całkowita długość z żyłką 80 cm</p><p></p><p class=\"MsoNormal\"><span style=\"background:#FFFFFF;\">Przekrój drutów jest trójkątny gładko przechodzący w stożek w miejscu w którym formuje się oczko robótki. Sam drut zakończony jest maleńką kuleczką dzięki czemu oczka nie zsuwają się z drutów. Wykonane są z doskonałej jakości tworzywa, elastycznego a zarazem trwałego. </span></p><p></p>','','ergonomiczne-druty-na-zylce-7-mm','','','','Ergonomiczne druty na żyłce 7 mm','','','',''),
(971,1,1,'<p><span style=\"font-family:\'Calibri Light\', sans-serif;color:#514e4d;\">Nowe przełomowe rozwiązanie w dziedzinie drutów dziewiarskich.PRYM </span><span style=\"font-family:\'Calibri Light\', sans-serif;color:#514e4d;\">światowy lider w produkcji ergonomicznych akcesoriów dziewiarskich i do szycia przedstawia nowe rozwiązanie dla drutów dziewiarskich. Przekrój drutów jest trójkątny gładko przechodzący w stożek w miejscu w którym formuje się oczko robótki. Sam drut zakończony jest maleńką kuleczką dzięki czemu oczka nie zsuwają się z drutów. Końcówki drutów posiadają specjalnie skonstruowane zapięcie dzięki któremu zabezpieczamy robótkę i możemy ją odłożyć bez obawy, że zsuną nam się oczka. Wykonane są z doskonałej jakości tworzywa, elastycznego a zarazem trwałego. </span></p><p></p><p><span style=\"font-family:\'Calibri Light\', sans-serif;color:#514e4d;\">Długość drutów 35 cm</span></p><p></p><p></p>','','druty-ergonomiczne-proste-6-mm','','','','Druty ergonomiczne proste 6 mm','','','',''),
