(1101,1,1,'<p>Włóczka Mink YarnArt</p><p></p><p>Skład: 100% poliamid <br />Motek: 50 gram / 75 mb <br />Zalecane druty: 6 mm do 7 mm <br />Zalecane szydełko: 6,5 mm <br /><br />Włóczka, którą pokochacie od pierwszego dotyku. 100% poliamid milutki  dający efekt futerka. Doskonale sprawdzi się w dzierganiu czapeczek, szalików, kapci i pluszaków</p><p>OSTATNIE SZTUKI</p><p>ETYKIETY MOGĄ BYĆ USZKODZONE LUB ICH BRAK</p><p>TOWAR PEŁNOWARTOŚCIOWY</p><p></p><p></p>','','wloczka-mink-342-baklazan','','','','Włóczka Mink 342 bakłażan','','','',''),
(1102,1,1,'<p></p><p><b>Włóczka Jeans</b> to jedna z bestsellerowych mieszek włóczek, oferowana przez tureckiego producenta <b>YarnArt</b>. Ta wyjątkowa mieszanka włókien bawełnianych i poliakrylowych jest doskonała do różnorodnych projektów dzierganych ręcznie. Włóczka ta cieszy się popularnością dzięki swojej wszechstronności i wyjątkowym właściwościom.</p><p><b>Włóczka Jeans</b> sprawdzi się znakomicie do tworzenia maskotek, kocyków, czapeczek, bluzeczek oraz wielu innych projektów. Jej unikalna kombinacja bawełny i poliakrylu sprawia, że jest niezwykle miękka i delikatna dla skóry.</p><p>Jednym z atutów tej włóczki jest jej bogata gama kolorystyczna. Dostępne są różnorodne odcienie, co pozwala na tworzenie projektów w zgodzie z własnym stylem i upodobaniami.</p><p>Warto również zaznaczyć, że każdy motek włóczki Jeans zawiera <b>50 gramów</b> materiału, co przekłada się na około <b>160 metrów długości</b> włókien. Skład włóczki to <b>55% bawełny i 45% poliakrylu</b>, co gwarantuje doskonałą równowagę między naturalnymi i syntetycznymi włóknami.</p><p>Producent rekomenduje użycie drutów o rozmiarze 3,5 mm oraz szydełka o tym samym rozmiarze, co pozwala osiągnąć optymalne rezultaty podczas pracy z włóczką Jeans. Dzięki tym wskazówkom oraz doskonałym właściwościom włóczki, Twoje projekty dziergane ręcznie będą wyjątkowe i satysfakcjonujące. <b>Włóczka Jeans od YarnArt</b> to idealny wybór dla wszystkich miłośników rękodzieła, którzy poszukują wysokiej jakości i wszechstronnej włóczki do swoich wyrobów.</p><p><b>Motek</b>: 50 gram / 160 mb</p><p><b>Skład</b>: 55% bawełna, 45% poliakryl</p><p><b>Zalecane druty przez producenta</b>: 3,5 mm</p><p><b>Zalecane szydełko przez producenta</b>: 3,5 mm </p><br />','','wloczka-jeans-yarn-art-kolor-mieta-79','','','','Włoczka Jeans Yarn Art kolor mięta 79','','','',''),
