(1147,1,1,'<div style=\"border:1pt solid #e3e3e3;padding:0cm;\">\n<p class=\"MsoNormal\" style=\"margin-top:15pt;margin-bottom:15pt;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Zabezpiecz swoje ręcznie wykonane pluszaki i zabawki dzięki Bezpiecznym Oczom do Zabawek. Te czarne oczy o średnicy 7 mm nadają się doskonale do dodania charakteru i uroku Twoim projektom.</span></p>\n<p></p>\n<p class=\"MsoNormal\" style=\"margin-top:15pt;margin-bottom:15pt;border:none;padding:0cm;\"><b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;border:1pt solid #e3e3e3;padding:0cm;\">Najważniejsze cechy:</span></b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\"></span></p>\n<p></p>\n</div><div style=\"border:1pt solid #e3e3e3;padding:0cm 0cm 0cm 5pt;margin-left:18pt;margin-right:0cm;\">\n<ul type=\"disc\" style=\"margin-bottom:0cm;margin-top:0cm;\">\n<li class=\"MsoNormal\" style=\"color:#0d0d0d;margin-left:18pt;border:none;padding:0cm;\"><b><span style=\"font-family:\'Segoe UI\', sans-serif;border:1pt solid #e3e3e3;padding:0cm;\">Bezpieczne dla Dzieci:</span></b><span style=\"font-family:\'Segoe UI\', sans-serif;\"> Wykonane z trwałego plastiku, te oczy są bezpieczne dla dzieci i idealnie nadają się do tworzenia pluszaków i innych zabawek dla najmłodszych.</span>\n<p></p>\n</li>\n<li class=\"MsoNormal\" style=\"color:#0d0d0d;margin-left:18pt;border:none;padding:0cm;\"><b><span style=\"font-family:\'Segoe UI\', sans-serif;border:1pt solid #e3e3e3;padding:0cm;\">Zacisk Plastikowy:</span></b><span style=\"font-family:\'Segoe UI\', sans-serif;\"> Zestaw zawiera oczy z zaciskiem plastikowym, który jest łatwy w użyciu i zapewnia trwałe umocowanie oczu w materiale.</span>\n<p></p>\n</li>\n<li class=\"MsoNormal\" style=\"color:#0d0d0d;margin-left:18pt;border:none;padding:0cm;\"><b><span style=\"font-family:\'Segoe UI\', sans-serif;border:1pt solid #e3e3e3;padding:0cm;\">Opakowanie Zawiera Parę:</span></b><span style=\"font-family:\'Segoe UI\', sans-serif;\"> Kupując ten produkt, otrzymujesz parę oczu, co wystarcza do jednej zabawki. Jest to praktyczne i ekonomiczne rozwiązanie dla Twoich projektów.</span>\n<p></p>\n</li>\n</ul>\n</div><p class=\"MsoNormal\" style=\"font-size:medium;\"></p><p> </p><p class=\"MsoNormal\" style=\"font-size:medium;\">Rozmiar: 7 mm<br />Materiał: plastik<br /><span style=\"font-family:Calibri, sans-serif;font-size:medium;\">Kolor: czarny</span><span style=\"font-family:Calibri, sans-serif;font-size:medium;\"> </span> </p>','','oczy-do-zabawek-czarne-o-7-mm','','','','Oczy do zabawek czarne Ø 7 mm','','','',''),
(1148,1,1,'<div style=\"border:1pt solid #e3e3e3;padding:0cm;\">\n<p class=\"MsoNormal\" style=\"margin:0cm 0cm 15pt;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Bezpieczne oczy do zabawek</span></b><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\"> <b>brokatowe </b>to wyjątkowy dodatek, który doda twoim pluszakom niepowtarzalnego charakteru. <b>Oczy mają średnicę 20 mm</b>, co czyni je idealnym wyborem dla różnorodnych zabawek, od małych maskotek po większe pluszaki. Ich unikatowy design łączy głęboką czerń z iskrzącymi akcentami brokatu, co nadaje im wyjątkowego blasku i wyróżnia na tle tradycyjnych oczu do zabawek.</span></p><p></p>\n<p class=\"MsoNormal\" style=\"margin:0cm 0cm 15pt;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Te oczy są nie tylko piękne, ale także trwałe i bezpieczne dla dzieci. Każdy zestaw zawiera zacisk plastikowy, który zapewnia łatwe i stabilne mocowanie bez potrzeby używania kleju czy innych substancji, co dodatkowo zwiększa bezpieczeństwo zabawek.</span></p><p></p>\n<p class=\"MsoNormal\" style=\"margin:15pt 0cm 0cm;font-size:12pt;font-family:Calibri, sans-serif;border:none;padding:0cm;\"><span style=\"font-family:\'Segoe UI\', sans-serif;color:#0d0d0d;\">Kupując ten produkt, otrzymujesz parę (2 sztuki) oczu w opakowaniu, co umożliwia kompletne wyposażenie jednej zabawki </span></p><p></p>\n</div><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"></p><p> </p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"><b>Kolor</b>: oko czarno przeźroczyste + brokat w kolorze jasny róż</p><p></p><p class=\"MsoNormal\" style=\"margin:0cm;font-size:medium;font-family:Calibri, sans-serif;\"><b>Materiał</b>: Plastik + materiał brokatowy</p><p></p><p class=\