(7,1,'To specify the suppliers of this product\'s combinations you can go to [1]{combinations_label}[/1] tab.','Aby określić dostawców kombinacji tego produktu możesz przejść do zakładki [1]{combinations_label}[/1].','AdminCatalogHelp',NULL),
(8,1,'Disable %product_name% input','Wyłącz wejście %product_name%','AdminGlobal',NULL),
