(13,1,'Multistore compatibility:','Zgodność z wieloma sklepami:','AdminModulesFeature',NULL),
(14,1,'select file','wybierz plik','AdminModulesFeature',NULL),
(15,1,'This module is compatible with the multistore feature. It can be either:','Ten moduł jest kompatybilny z funkcją multistore. Może to być:','AdminModulesFeature',NULL),
(16,1,'This module is not compatible with the multistore feature because it would not be useful.','Ten moduł nie jest kompatybilny z funkcją multistore, ponieważ nie byłby użyteczny.','AdminModulesFeature',NULL),
(17,1,'Set the order as in transit.','Ustaw zamówienie jako „w tranzycie”.','AdminShopparametersFeature',NULL),
(18,1,'We recommend that you deactivate your store while performing maintenance. Note that it will not disable the webservice.','Zalecamy dezaktywację sklepu podczas przeprowadzania konserwacji. Należy pamiętać, że nie spowoduje to wyłączenia usługi sieciowej.','AdminShopparametersHelp',NULL),
(19,1,'Are you sure you want to upgrade this module?','Czy na pewno chcesz zaktualizować ten moduł?','AdminModulesNotification',NULL),
(20,1,'Are you sure you want to upgrade these modules?','Czy na pewno chcesz zaktualizować te moduły?','AdminModulesNotification',NULL),
(21,1,'We strongly advise you to upgrade the modules on maintenance mode to avoid any cache issues.','Zdecydowanie zalecamy zaktualizowanie modułów w trybie konserwacyjnym w celu uniknięcia problemów z pamięcią podręczną.','AdminModulesNotification',NULL),
(22,1,'Add an image before product name on delivery slip','Dodaj obraz przed nazwą produktu na liście przewozowym','AdminOrderscustomersHelp',NULL),
(23,1,'An order message with the same name already exists in %s.','Wiadomość zamówienia o tej samej nazwie już istnieje w %s.','AdminOrderscustomersNotification',NULL),
(24,1,'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.','Włącz tę opcję, jeśli chcesz zezwolić na znaki akcentowane w przyjaznych adresach URL. Powinieneś aktywować tę opcję tylko wtedy, gdy używasz znaków innych niż łacińskie; dla wszystkich zestawów znaków łacińskich Twoje SEO (Search Engine Optimization) będzie lepsze bez tej opcji.','AdminShopparametersHelp',NULL),
(25,1,'The value of the PHP.ini setting \"max_input_vars\" must be increased to %value% in order to be able to submit the product form.','Wartość ustawienia PHP.ini „max_input_vars” musi zostać zwiększona do %value%, aby możliwe było przesłanie formularza produktu.','AdminNotificationsError',NULL),
(26,1,'Invalid email: %invalid_email%.','Nieprawidłowy adres e-mail: %invalid_email%.','AdminNotificationsError',NULL),
(27,1,'Invalid emails: %invalid_emails%.','Nieprawidłowe adresy e-mail: %invalid_emails%.','AdminNotificationsError',NULL),
(28,1,'The email is already used, please choose another one','Adres e-mail jest już używany, proszę wybrać inny','AdminNotificationsError',NULL),
(29,1,'[1] products were successfully removed.','[1] produktów zostało pomyślnie usuniętych.','AdminNotificationsSuccess',NULL),
(30,1,'[1] products were successfully added.','[1] produktów dodano pomyślnie.','AdminNotificationsSuccess',NULL),
(31,1,'The product was successfully added.','Produkt został pomyślnie dodany.','AdminNotificationsSuccess',NULL),
(32,1,'Note that this page is available in a single shop context only. Switch context to work on it.','Należy pamiętać, że ta strona jest dostępna tylko w kontekście pojedynczego sklepu. Zmień kontekst, aby nad nią pracować.','AdminNotificationsInfo',NULL),
(33,1,'This page is not yet compatible with the multistore feature. To access the page, please [1]disable the multistore feature[/1].','Ta strona nie jest jeszcze zgodna z funkcją multistore. Aby uzyskać dostęp do strony, [1]wyłącz funkcję multistore[/1].','AdminNotificationsInfo',NULL),
(34,1,'Note that this feature is available in all shops context only. It will be added to all your stores.','Należy pamiętać, że ta funkcja jest dostępna tylko w kontekście wszystkich sklepów. Zostanie dodana do wszystkich Twoich sklepów.','AdminNotificationsInfo',NULL),
(35,1,'Note that this page is available in all shops context only, this is why your context has just switched.','Należy pamiętać, że ta strona jest dostępna wyłącznie w kontekście wszystkich sklepów, dlatego też Twój kontekst właśnie się zmienił.','AdminNotificationsInfo',NULL),
(36,1,'Your order has been changed','Twoje zamówienie zostało zmienione','EmailsSubject',NULL),
